(256, 66000, 'Donation of food material to needy', 'Nashik', '2020-07-02', 'Ln Ritu Choudhary,Ln Sanjay Desarda LCO Jalgaon city', 'Club has its own Food bank since 4 years.Wherever there is a need club distributes Food material,food to the needy.Club. distributed Food material to needy Paper distribution workers who. due to corona got affected with earnings.PDg Ln Dr Vikrant donated 1 month earning to food bank .The activity was performed by food bank of Panchvati Total 150 families were given Food material.This activity was jointly done with Divya Bhaskar Group', 28, 'true', 450, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Divya Marathi Media centre', 4582968, 51530, 0, ''),
(257, 22000, 'Donation of food material to Adhar Ashram', 'Nashik', '2020-07-27', 'None', 'Bal sudhar Gruh is semi Government activity where boys, girls, women of criminal nature,few criminals are kept for revitalation.Our club through Food bank has been helping them since last 4 years.During covid help to this institution has been reduced .Dr Vikrant gave donation to food bank through which Food material for 1 month was donated to releive Hunger..As it is restricted area not many members attended. ', 2, 'true', 54, 'INTERNATIONAL ACTIVITIES', 'Hunger ', 'Food grains donation / anaj dan', 'Bal Sudhargruh Premises Tidke colony', 4582968, 51530, 0, ''),
(258, 22500, 'food Material Donation to Needy', 'Nashik', '2020-07-18', 'Ln Ritu Choudhary', 'Press photographers play important role in making us reach news pictorically.Corona has been atough time for all with no salaries.We our club with Food bank came ahead to donate them food materials. ,snacks for period on 45 days.All praised Lions .News was not given to press for release as they were the part of it which may have created a different message .But Lions serve for non photo also thats proved', 4, 'false', 27, 'INTERNATIONAL ACTIVITIES', 'Hunger ', 'Food grains donation / anaj dan', 'Sushila clinic Gangapur road Branch ', 4582968, 51530, 0, ''),
