(264, 0, 'Salam Corona', 'Pune', '2020-07-01', 'Soniya Gole', '1. Certificate given to Digambar Belsare for doing great work during Pandemic. He did blood donation twice in pandemic, counselled people for Yoga and its importance in epidemic, advised and taught poor people about the hygiene and sanitation. He distributed dry ration kits to the needies and took care of Senior Citizens. Hats off to such a Covid Warrior.\r\n2.Certificates given to Rahul Rajguru & Deepak Sable for working in Sanitation & hygiene from Corporation without fear during pandemic. As they are the people behind our cleanliness & health hygiene, Hats off to such Covid Warriors. Salaam Rahul & Deepak.\r\n3.Felicitated Ganesh Rajguru from Ramtekdi for his incredible work during pandemic. He fearlessly distributed food packets, sanitisers, dry ration kits, sanitary pads, medicines for asthama, BP, Diabetes, thyroid in the Red Zone as well despite of the sad demise of his mother and grand daughter in the last month due to diabetes &  cancer respectively. Hats off to such a great Covid Warrior. Salam Ganesh Rajguru', 2, 'false', 5, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Pune', 5190752, 84998, 0, ''),
