(277, 3000, 'RT PCR TEST CENTRE FOR COVID-19', 'Manmad', '2020-07-21', 'Zc Ln Ashish Zawar', 'Inauguration of covid RTPCR swab testing private centre done in small town like manmad.\r\nby Lions club of manmad pride with thyrocare.  Technician will be available daily from 9.0 am to 10.0 am in morning daily uptil pandemic covid situation persist.\r\nThis make possible suspected patients to get early treatment and save life of people from corona virus.', 20, 'true', 61, 'MEDICAL ACTIVITIES', 'Free Medical Camps', 'Free Medical Camps', 'Ganesh Plaza Behind traffic police chowki malegaon naka manmad', 4948949, 109439, 0, ''),
