(283, 12900, 'Donation of immunity booster tablets and cleaning material to rural people', 'NASHIK', '2020-07-26', 'MJF LN.RAM DAWARE', 'And as new lionistic year has started lcons, under the leadership of new president Ln. Dr. Nupura  Prabhu, played an important role in the fight against the covid 19 pandemic, that is grappling the entire world.\r\nIn response to the call of action given by the district governor, Ln. Abhay Shastri, to eradicate the corona virus,   Arsenic Album 30 HOMEOPATHIC MEDICINES, were procured from Motiwala homeopathic medical college and distributed in the rural villages surrounding Trimbakeshwar.\r\nThe medicines tend to boost the immunity of the recipients and are there by known to cause a decrease in the nos. of cases caused by of the corona virus. The tablets are to be taken for three days of a month, followed by repeat of the doses in the next month. Sufficient quantity was provided, so as to benefit 1000 people residing in the rural areas.\r\nSwami Shreekanthanand  head of RAMKRISHNA  AROGYA SANSTHAAN,also played a very important role in the project , particularly in the distribution  of the medicines in the rural areas.\r\nThe activity was conducted, maintaining all protocols of social distancing as demanded by the present situation. Along with this 300 sanitizer bottles and disinfecting phenol solution were also provided  to the villagers  to protect themselves.\r\nPresident Ln.Dr. Nupura Prabhu, IPP ln.Nilima Dawre, and Ln. Dr. Amit Prabhu ,Ln.Sarika Kalantri(Secretary ) and ln. Abhay Patil(treasurer)participated in the successful execution of the service activity .                                                                 \r\n', 9, 'true', 1000, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. More Than 10000)', 'Ajaneri ,Trimbakeshwar', 4520195, 97806, 0, ''),
