(307, 7000, 'Corona Warriors', 'Pune', '2020-07-30', 'Arun Khanolkar', 'We felicitated 20 Corona Warriors with Momento, Certificate & Shriphal at Kesnand, Wagholi . We feliciated to PHC Doctors, Asha Workers, Sweepers, Safai Kamgar, Police Patil etc. BDO , Sarpanch & Up- Sarpanch were really keen to arrange this event. They expressed their gratitude. And shown interest for many activities in future.', 32, 'true', 8, 'MEDICAL ACTIVITIES', '', '', 'Aundh', 4321266, 61860, 0, ''),
