(310, 4500, 'Felicitation & Honor of Corona Worriers ', 'Pune', '2020-07-01', 'Ln. Vijay Jaju', 'As a social responsibility we should felicitate and recognize unique services rendered police department for society in Corona pandemic period. They are giving their services to public tireless by taking risk to their life. On behalf of our Club we had decided to facilitate the staff of the Swargate Police station, Pune on 1.7.2020, Wednesday. In this program, we have handed over appreciation Certificate, N-95 quality mask and Handkerchief with coconut & flower bouquet to all staff members of the Police Station Staff.', 12, 'false', 125, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Swargate Police Station, Pune', 4545630, 48692, 0, ''),
(311, 3500, 'Honor of Doctors for service to Public in Covid19 Pandemic', 'Pune', '2020-07-02', 'Ln. Vijay Jaju', 'As a social responsibility it was very important to felicitate and recognize unique services rendered by Medical Staff of Hospital who have worked in Corona Ward for and served corona patients in Corona pandemic period by taking risk to their life. They are giving their services to public tireless. On behalf of our Club we had arranged program to facilitate the Doctors and their staff at Nanded City, Sinhagad Road, Pune, 2.7.2020, Thursday. In this program, we have handed over appreciation Certificate, N-95 quality mask and Handkerchief with coconut & flower bouquet as a token of appreciation to all doctors and staff members who worked in Govt Hospital and private Hospital.', 3, 'false', 10, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Nanded Pultispeciality Hospital, Sihangad Road, Pune', 4545630, 48692, 0, ''),
(312, 125000, 'Devrai', 'Pune', '2020-08-02', 'Ln Kishore Mohalkar district environment chairperson', 'Our districts first  Environment  program,  tree plantation was held  on 2nd August 2020, in Birobawadi, bottom of Purandr fort, pune. \r\nOn the ocassion of National tree day. \r\nIn presence of districts Environment chairman Ln Kishor Moholkar,  chief guest Dr. Jadhav sir, head , Tilk Maharashtra vidypith, sociology  section, \r\nSarpanch Mr. Jankar  \r\nLn Muyur Bagul and  Ln Suryavanshi from LCP ECO friends , Ln Manisha Moholkar, Ln. Sourab Moholkar, Ln. Vishakha Navkhare of Pune Smar City and villagers of Birobawadi. And Social worker Akash Bhagat \r\n\r\n270 Indian trees Planted. on 1 acre.\r\nUnder guidance of ZC Ln Sagar Bhoite and RC Ln Bagdi\r\nThanks to all participants. \r\nRegards\r\nPST LCP Pune smart city. \r\nðŸ™ðŸ™', 12, 'false', 20, 'DISTRICT ACTIVITIES', 'Afforestation', 'Afforestation', 'Bahirwadi', 3429601, 112028, 0, ''),
