(320, 0, 'Webinar on Entrepreneur Talk on Start Up 101 and Innovation â€œ.', 'Pune', '2020-08-08', 'No ', '\r\n2. On the occasion of International Youth Day , Lions Club Pune Sinhgad Road in association with Sou. Venutai Chavan Polytechnic organised a webinar on â€œ Entrepreneur Talk on Start Up 101 and Innovation â€œ. The speaker was Mr. Ashish Tetli Co - Founder, ARTUS, Greater St. Louis, United States. 130 participants took the benefit of this webinar. ', 20, 'false', 130, 'EVENT CELEBRATION', 'International Youth Day', 'International Youth Day', 'Online ', 4625291, 57692, 0, ''),
