(323, 0, 'Salaam to Corona Warriors', 'Pune', '2020-07-01', 'MJF Ln. A. K Japher', 'Salaam to Corona Warriors Lions Club of Pune Sapphire members felicitated Covid19 Warriors Of PCMC Area 1.) Dr Anil Roy(Sr. Medical officer of health, PCMC) and 2.) Dr Laxman Gophane(Sr Medical Officer and in charge of Bhosari Covid Hospital) in a small restricted function at Pimpri today. President Ln Sheela Krishnadas, past President Ln Sarala Joy and senior Lions of Sapphire club Mjf Ln Harinarayanan, Mjf Ln Joy Joseph, Mjf Adv. K M Roy, Ln Krishnadas, Ln Sasikumar, Ln Omanakuttan attended the functon. Presidents handed over the \"Internatiinal Covid 19 Warriors Certificates to both Doctors. Dr Roy while appreciating the club members for this noble gestures informed the state of affairs in PCMC On Covid situation and appealed to the public to keep social distance and follow all norms. He requested all not to be panic and socially isolate the patients.', 2, 'false', 2, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Fusion Park, Morwadi, Pimpri, Pune - 18', 5159746, 66801, 0, ''),
(325, 6500, 'N95 Masks to Police Officers', 'Pune', '2020-07-16', 'MJF Ln. A. K Japher', 'Distribution of N95 Masks to Police officers Lions Club of Pune Sapphire distributed 100 N95 masks to the police officers at Nigdi Police station today at 11:30 am. For the same, President Ln. Sheela Krishnadas, past President and IPP Ln. Sarala Joy, MJF Ln. Harinarayanan and MJF Ln. Adv. K. M. Roy were present for this event. The masks were handed over to PSI Dule. This event was conducted to ensure the safety of our corona warriors who are working relentlessly for the safety of citizens.', 2, 'false', 15, 'OTHER IMPORTANT', 'Lions Quest', 'Lions Quest', 'Nigdi Police Station', 5159746, 66801, 0, ''),
(326, 4200, 'Slum Rehabilitation', 'Pune', '2020-07-30', 'MJF Ln. A. K Japher', 'Our District jointly with slum Rehabilatation authority has chocked out some slum areas where they are in need of Oxymeter and Thermometer urgently to check and take care accordingly. Therefore, all the clubs were requested to donate generously to help rehabilitate these people by providing the medical aid kits as mentioned above. 6 oxymeters have been donated worth Rs. 4200 from Lions Club of Pune Sapphire.', 1, 'false', 0, 'OTHER IMPORTANT', 'Lions Quest', 'Lions Quest', 'Pimpri-Chinchwad', 5159746, 66801, 0, ''),
(327, 0, 'Blood Donation Drive', 'Pune', '2020-08-08', 'MJF Ln. A. K Japher', 'Lions Club of Pune Sapphire, Lions Club of Pune Pimpri Gold in Association with Pune Malayalee Federation today organized a Blood Donation camp at Pimpri Associated office.The camp was conducted by Moraya Blood Bank. President Ln Sheela Krishnadas, secretary Ln Sajidha Amrutraj, 1st VP Ln Sneha Maneesh, MJF Ln K Harinarayanan, MJF Ln Rajan R Nair, MJF Ln K M Roy, Ln Amruthraj, Ln Krishnadas, Ln M G Pillai and Ln A S Hamsa were present. Ln M G Pillai donated the first unit and inaugurated the function. 25 blood bottles in total were donated to Moraya Blood Bank.', 5, 'true', 0, 'MEDICAL ACTIVITIES', 'Blood Donation', 'Blood Donation', 'Fusion Park, Morwadi, Pimpri, Pune - 18', 5159746, 66801, 0, ''),
