(628, 11700, 'LCC &  School Independence day occasion  taken the  Indian flag Hoisted  at Navonmesh School, Chakan and hanuman madhyamic Scho', 'Chakan and Chinchosi', '2020-08-15', 'Ln. Prakash Mutke', 'LCC And Navonmesh School  Independence day occasion taken LCC taken the  Indian flag Hoisted  at Navonmesh School, Chakan  on Saturday , 15 August 2020  at 7 am to 10 am.  This Day flag hoisted celebrated in the school. Total  there were 3 Lions Members Presented. President - Ln. Balasaheb Mutke, Ln.  Prakash Mutke, Ln. Prakash Mutke. Tea and breakfast were served there. Total expenses were Rs. 1000/- service provide to 30 People.\r\nAnd Second The indian  flag was hoisted at the school in Chinchoshi. Shri Baburao Mali Saheb (Co-Inspector of Police). Time -7am to 10 am. Cost-700 Breakfast and tea water. And giving cheque of Rs.10000 for School painting to hanuman madhyamic School, Chinchosi. Member-25 staff were present\r\nSponsored by Ln.  Prakash Mutke and Ln. Baburao Mali. Total Expenses Were Rs.11,700/-.  PST LIONS CLUB CHAKAN (2020-2021) ', 3, 'false', 55, 'OTHER IMPORTANT', 'Youth Welfare', 'Youth Welfare', 'Navonmesh School, Chakan and hanuman madhyamic School, Chinchosi', 4744716, 50598, 0, ''),
