(630, 3500, 'LCC did Tree Plantated  at Ln. Dr. V. G. Joshi Eye Hospital, Chakan', 'Chakan', '2020-08-15', 'Ln. Balasaheb Mutke', 'LCC did Tree Planted  at Ln. Dr. V. G. Joshi Eye Hospital, Chakan  on Saturday , 15 August 2020  at 11 am to 5 pm. In that tree plantation include Ashok, Parijatak, Rose, Jaswandi, tulas, sadafuli etc 27 type tree planted. Total 20 lions members Presented there.\r\n\r\nSponsored by President Ln.Balasaheb Mutke & Ln. Prakash Mutke. Total Expenses Were Rs.3500/-.  PST LIONS CLUB CHAKAN (2020-2021)\r\n', 6, 'false', 101, 'INTERNATIONAL ACTIVITIES', 'Enviornment', 'Tree plantation', 'Ln. Dr. V. G. Joshi Eye Hospital, Chakan.', 4744716, 50598, 0, ''),
(631, 41200, 'LCC did 4 idols was Established on Entrance Gate at Ln. Dr. V. G. Joshi Eye Hospital, Chakan', 'chakan', '2020-08-23', 'Ln. Prakash Mutke', 'LCC did 4 idols was Established on Entrance Gate at Ln. Dr. V. G. Joshi Eye Hospital, Chakan  on Sunday , 23 August 2020  at 10 am to 4 pm. In that idols include Lord Ganesh, Lord Vithal and Rukmini, sant Dnyaneshwar, Sant Tukaram was Established on Hospital Entrance Gate.  Total 110 lions members Presented there.\r\nSponsored by Ln. Prakash Mutke , Ln. Dr. Ramesh Jadhav And President Ln.Balasaheb Mutke.  Total Expenses Were Rs.41200/-.  PST LIONS CLUB CHAKAN (2020-2021)\r\n', 6, 'false', 117, 'OTHER IMPORTANT', 'Legal Aid', 'Legal Aid', 'Ln. Dr. V. G. Joshi Eye Hospital, Chakan.', 4744716, 50598, 0, ''),
