(729, 5000, 'Medical Health check-up Camp', 'Pune', '2020-08-20', 'Ln. Madakini Malavade', 'We organized medical health check-up camp at ShivSagar society, Sinhagad road, Pune with association of Pune Municipal Corporation and their Doctor\'s team. Total beneficiary people were 620. 8 Persons were doubtful for Covid 19 and immediately shifted them for treatment at PMC center located at P.L.Deshpande garden, Pune. All the medical expenses were donated by our club. Also, provided breakfast and lunch to PMC doctors and their team. Total Expenses in this activity was Rs 5000/- Our past president Ln. Anuradha Tallu and Ln. Prashant Manjire were present during the said activity.', 75, 'false', 620, 'MEDICAL ACTIVITIES', 'Free Medical Camps', 'Free Medical Camps', 'ShivSagar society, Sinhagad road', 4928820, 121506, 0, ''),
