(733, 5000, 'Cyber security', 'Nashik, Maharashtra', '2020-08-02', 'MJF LN.RAM DAWARE', '\r\nCYBER SECURITY\r\nIt is a need of time, specially this COVID-19, this lockdown really realized us about cyber security, cyber saksharta! And we should be always aware, should be alert while using any online medium. \r\n And so LIONS CLUB OF NASIK STAR pined that point and thought to arrange awareness seminar for the same. Keeping situation of covid 19 in mind it was finalized to take it online webinar on 2nd Aug 2020. For that we got certified trainer, speaker who has conducted 1000+ awareness workshops regarding same i.e. Mr. Onkar Gandhe.\r\nIt is great pleasure for club  that for this wonderful activity our own district governor Ln. Abhay Shastri , VDGI Ln. Hemant Naik, VDGII Ln. Rajesh Kothawade , RC Ln. Rajendra Pagar, ZC Ln. Ritu Chodhari , GST Chairperson Ln. Sunita chitins,PDG Ln. Vaidya Vikrant Jadhav and PDG Ln. Chandrahas Shetty were present. 100+ peoples attended this webinar and added value to their cyber knowledge. This webinar was conducted for more than 2hrs. Every participant appreciated, was thankful for arranged webinar which was full of knowledge. And also requested to arrange such activities frequently.\r\n\r\n               	\r\n\r\n', 200, 'true', 100, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'online on zoom, webinar ', 4520195, 97806, 0, ''),
(734, 30000, 'Donation of immunity booster tablets Arsenic Album 30', 'Nagalwadi village', '2020-08-26', 'MJF LN.RAM DAWARE', '\r\nActivity: arsenic album 30 tabs distribution, 300 bottles\r\nDate: 26/8/2020\r\nTime:  11:00am\r\nVenue: Nagalawadi village\r\nBenifisheries: 1200\r\nLion Present: 02\r\nLion Hours: 02\r\nPurpose of Activity: to boost immunity and fight against CORONA VIRUS\r\nLooking at this pandemic situation of COVID-19, Lions club of Nasik star again distributed immunity booster tablet ARSENIC ALBUM 30, to village Nagalwadi. This will surely help to boost immunity of villagers. IPP Ln. Nilima Daware presented this activity and handed over to the Sarpanch of Nagalwadi village.\r\n\r\n', 2, 'false', 1200, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. More Than 10000)', 'Nagalwadi School', 4520195, 97806, 0, ''),
(735, 3000, 'Tulsi sapling plantation', 'Nagalwadi village', '2020-08-26', 'MJF LN.RAM DAWARE', '\r\nActivity: Tulsi sapling plantation\r\nDate: 26/8/2020\r\nTime:  11:30am\r\nVenue: Nagalawadi village\r\nLion Present: 02\r\nLion Hours: 02\r\nPurpose of Activity: to increase oxygen level in the air  \r\nAs we all know the benefits of TULSI, it helps to treat against cardiovascular illness, lowers cholesterol level, increases oxygen level in air in the day timeâ€¦etc. Then what else can be the better place rather than School. Keeping this in mind Lions club Nasik star Planted TULSI sapling in the Nagalawadi school premises.IPP Ln. Nilima Daware presented this activity with principal of the school.\r\n\r\n\r\n\r\n\r\n \r\n\r\n\r\n', 2, 'false', 100, 'INTERNATIONAL ACTIVITIES', 'Enviornment', 'Tree plantation', 'Nagalwadi School', 4520195, 97806, 0, ''),
