(833, 2000, 'LCO Nasik star felicitates 10th std. toppers of Bramhanwade school ', 'Nashik, Maharashtra', '2020-09-05', 'Mjf ln. Nitin Marathe', 'LCO Nasik star Felicitates 10th std toppers of Brahmanwade school : \r\n#Date: 5th sept 2020\r\n#place: Brahmanwade , trimbakeshwar\r\n\r\n\r\n Treasurer ln.abhay Patil congratulated the students for their outstanding performance .The students who secured the top 5 positions in their class were awarded medals and cash prizes which were sponsored by Ln.Nitin Marathe , ln Meera Marathe and Mrs.Lalita V Prabhu.\r\nfollowing students were felicitated:\r\n   Gayatri Ghule: 81.4% \r\n   Tanaji aaher: 79% \r\n   Jyoti Shendge: 78.4% \r\n   Rohit Mgar: 77.4% \r\n   pratiksha Gangurde: 76.4%', 25, 'true', 6, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(834, 28000, 'LCO Nasik star distributes Arsenic Album-30 tablets to Families of Bramhanwade ', 'Nashik, Maharashtra', '2020-09-05', 'MJF LN.RAM DAWARE', 'LCO NASIK star distributes arsenic album 30 to families of  brahmanwade \r\n#fightCoronavirus\r\n# date: 5th sept 2020\r\n# place: brahmanwade trimbakeshwar\r\n\r\nArsenic album 30,the immunity boosting medicine was distributed to 700 families reaching over 2800 people  of the village.\r\n Ln Nilima Daware played a major role in procuring them,explaining the importance and method of consuming them. Along with ln ram daware the medicine s were distributed.', 25, 'true', 2800, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. More Than 10000)', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(836, 11000, 'LCO Nasik star donnates laser printer to Bramhanwade school', 'Nashik, Maharashtra', '2020-09-05', 'MJF LN.RAM DAWARE', 'LCO Nasik star donates a laser printer to Brahmanwade school \r\n#date: 5th sept\r\n#place: Brahmanwade school, trimbakeshwa\r\n\r\nResponding to the request made by the school teachers LC Nasik Star also presented the school with a laser printer to aid the teachers in their administrative work.\r\nThis was sponsored by Lion Prashant and Nisha Bharbat .', 25, 'true', 95, 'OTHER IMPORTANT', 'Youth Welfare', 'Youth Welfare', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
