(857, 91000, 'LCO Nasik star succesfully completes LOAN-A-PHONE campaign', 'Nashik, Maharashtra', '2020-09-05', 'Mjf ln. Nitin Marathe', 'Activity: Loan-a -phone \r\n Date:  5/09/2020 \r\n Time: 6:00pm \r\n Venue: Bramhanwade Community Hall \r\n Beni fisheries: \r\n Lion Present: 25 \r\n Lion Hours: 25 \r\n Purpose of Activity: To provide access for Digital Education in this       pandemic of COVID 19. \r\nDue to this pandemic as the sSmartphoneslosed, we initiated to donate Smart phones to the students of the remote area (Bramhanwade)who are not able to avail the digital education. We collected 20 second-hand smart phones for the students of 10thstd who almost got disconnected from schoolsINTERNETucation. The club also provided them with JIO INTENET CONNECTION and the SIM cards are registered under the names of their parents. For more ease team jio cooperated us completely and after the proper guidanceâ€™s and instructions given by our club president Dr.Ln. Nupura Prabhu. We also demonstrated the usage of zoom application.', 25, 'true', 40, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. More Than 10000)', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(858, 3000, 'LCO Nasik star conducts TRAIN THE TRAINER successfully', 'Nasik', '2020-05-11', 'Mjf ln. Nitin Marathe', 'Activity: Train the Trainer \r\n Date: 11/09/2020 \r\n Time: 5:00pm \r\n Venue : Dental concept \r\n Beneficiaries: 44\r\n Lion Present: 07 \r\n Lion Hours: 14 \r\n Purpose of Activity: to train the teachers of Bramhanwade school for use of zoom application \r\n 20 mobiles were donated to Brahmanwade school on 5th of sept such that they can avail virtual education. To move a step ahead, LCO Nasik star conducted a TRAIN THE TRAINER session to educate the teachers of the same school to conduct online classes. For online education purpose use of ZOOM application is increasing day by day. Looking at the scenario LCO Nasik star decided to train the teachers of Brmhanwade school for the same. So that they can conduct online lectures perfectly. Ln. Lalit Pawar and Ln. Archana Singh took the lead and taught them thoroughly about the use of ZOOM application. Ln. Amit Prabhu started with the concept and activity. President Ln. Nupura Prabhu thanked everyone who were present there.', 14, 'false', 44, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Nasik', 4520195, 97806, 0, ''),
(859, 3000, 'LCO Nasik star conducts TRAIN THE TRAINER successfully', 'Nashik, Maharashtra', '2020-05-11', 'MJF LN.RAM DAWARE', 'Activity: Train the Trainer \r\n Date: 11/09/2020 \r\n Time: 5:00pm \r\n Venue : Dental concept \r\n Beneficiaries: 45 \r\n Lion Present: 07 \r\n Lion Hours: 14 \r\n Purpose of Activity: to train the teachers of Bramhanwade school for use of zoom application \r\n 20 mobiles were donated to Brahmanwade school on 5th of sept such that they can avail virtual education. To move a step ahead, LCO Nasik star conducted a TRAIN THE TRAINER session to educate the teachers of the same school to conduct online classes. For online education purpose use of ZOOM application is increasing day by day. Looking at the scenario LCO Nasik star decided to train the teachers of Brmhanwade school for the same. So that they can conduct online lectures perfectly. Ln. Lalit Pawar and Ln. Archana Singh took the lead and taught them thoroughly about the use of ZOOM application. Ln. Amit Prabhu started with the concept and activity. President Ln. Nupura Prabhu thanked everyone who were present there.', 25, 'false', 45, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Nasik', 4520195, 97806, 0, ''),
