(1002, 3000, 'Skill Development Webinar', 'Pune', '2020-09-19', 'RC MJF Lion Sudam More, ZC Lion Dilipsinh Mohite', 'LCP Nigdi, in association with Prerana Skill Development organised an online webinar on the subject \'Horizons of Business\'. A total of 63 students and working people attended this webinar. Past District Governor Lion Omprakash Pethe was the spokesperson, MJF Lion Ashok Yewale (District Chairman - Skill Development) was the Convener. President Lion Maruti Musmade, Secretary Lion D S Behera, ZC Lion Dilipsinh Mohite, RC MJF Lion Sudam More, 2D MJF Lion Haridas Nair, Lion Harsh Nair and Jt. Secretary Lion Rishikesh Musmade showed their online presence for the same', 20, 'true', 63, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Hari Construction Office and Streamed Online', 4893941, 46113, 0, ''),
(1003, 2530, 'Donation of Eatables and Other Items', 'Pune', '2020-09-17', '', 'On behalf of LCP Nigdi, Lion Shivkanya Musmade donated eatables and other household materials worth Rs. 2530 to Sangeeta Kamble, who works as a house maid. Considering the current Covid condition, an electric steamer was also included in the items donated. Mrs. Sangeeta and her mother-in-law are the only bread earners of their family of 11 members. Lion Maruti Musmade, Lion D S Behera, Lion Geeta Behera, Lion Ayshalina Behera and Lion Rishikesh Musmade were present for the same.', 6, 'false', 11, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Swapnapoorti Phase - 1 Hsg. Society', 4893941, 46113, 0, ''),
