(1128, 10000, 'Service to Covid-19 Pateints', 'Lonavla', '2020-09-15', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers....\r\n\"Where There Is A Need There Is A Lion\"..\r\nHow Rightly Said & Proven Today Tue 15th Sept....\r\nOur 6 Lion Supremo Members & 2 Supremo Well Wishers Were A Part Of The Drive Organized By Our Hon LMC President Surekha Jadhav Madam..V.P Shree Shridhar Poojari Sir & C.O Shri Ravi Pawar Sir....*This Was A *Door To Door Drive By The LMC To Check Every Family For The Covid-19 Virus....6 Lion Supremo Members & 2 Well Wishers Were Part Of This Drive With Other Volunteers (Swayam Sevaks)..\r\nOur 6 Lion Supremo Members Namely....\r\n1) President Ln Suraiya Wadiwala....\r\n2) Treasurer Ln Apoorva Lohar....\r\n3) Club Well Wisher & Prospective Member Prathmesh Were Posted At The Covid Care Centre-Jhalawadi-Lonavala.... Where since Last 5 Months Our Members\r\n4) Ln Javid Kalim Sayyed &\r\n5) Ln Dr Aaliya Javid Sayyed Are Posted As Chief Commando (Lonavala City Police Station) & Chief Medical Officer & Administrator Respectively..\r\nOur Other Members.. Namely..\r\n6) Ln Uday Shetty..\r\n7) Ln Sagar Tawre &\r\n8) Club Well Wisher Harshal Were Appointed At Bhangarwadi Area To Check Families Door To Door....\r\nLn Suraiya Waiwala+Ln Apoorva Lohar & Prathmesh posted At CCC Jhalawadi Were Conducting RAPID ANTIGEN TESTS (RAT) On The Suspected Patients.... Team Lion Supremos Are Always There Where There Is A Crisis.... \"Supremos Ready To Help\" Under The Leadership Of President Ln Suraiya Wadiwala... Leading The Supremos From The Front.... Proud Of The Whole Supremos Team.', 42, 'false', 200, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Center', 5099270, 122786, 0, ''),
