(1131, 2000, 'Ayush Kadha Distribution', 'Lonavla', '2020-09-13', 'Apoorva Lohar', 'Respected Supremo Members.... Yesterday 13 th September Hon President & V. President LMC..Officials & Doctors Of Covid Care Centre-Jhalawadi requested Us To Come For A Short Meeting..\r\nV attended the meet & were requested by the authorities there that v should provide them the Immunity Booster Kaada for the inmates & doctors of the CCC....\r\nEarlier we were providing this KAADA & Was being arranged & Sponsored By Ln Sanjay Lohar prepared by Ln Chetna Lohar....\r\nThe Observation & Contention Of The CCC Authorities is That It Really Helps The Patients & Doctors Too..\r\nHence It Should Be Re Started....\r\nFor This Purpose We Seek & Request For Voluntary Donation From All Our Members To Help In This Humanitarian Cause....\r\nThe Apporx Cost Of The Prepared Kaada (60 Glasses per day) for complete 1 Month Is Rs 6000/-\r\nRequesting Members To Plz Contribute For This Helpful Cause.... plz Declare Ur Donations On The Group & The Amount Will Be Collected From U....\r\nPlz Co operate & Help for this Noble Cause....\r\nMsg On Behalf Of President Ln Suraiya Wadiwala & Her Team.', 4, 'false', 60, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Center', 5099270, 122786, 0, ''),
(1132, 1500, 'Animal Feeding in Covid-19 Pandamic', 'Khandala', '2020-09-10', 'Ameen Wadiwala', 'Dear Supremos & Well Wishers Good Evening.... 158 th Day Of Our Ongoing Activity Of Feeding The Stray Animals..Today Evening Wednesday 10th Sep.. Team Supremos Visited Rajmachi- Khandala..Where The Hungry Monkeys & Dogs Were Fed With Seengdanas.. Chana Dal..Bhuttas (Maize) & Biscuits..Coincidentally Today We Even Found A Hungry Cat & Fed Her Buiscuits..Under The Leadership Of President Ln Suraiya Wadiwala.. Team Supremos Was Led By Dist Chairperson (20-21)-Jeev Daya Ln Apoorva Lohar \r\nA Consistent Activity Since Last 158 Days By Team Lonavala Supremos..', 10, 'false', 50, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Center', 5099270, 122786, 0, ''),
(1134, 1500, 'Animal Feeding in Covid-19 Pandamic', 'Khandala', '2020-09-09', 'Apoorva Lohar', 'Dear Supremos & Well Wishers Good Morning.... 157 th Day Of Our Ongoing Activity Of Feeding The Stray Animals..Yesterday Evening Wednesday 9th Aug.. Team Supremos Visited Rajmachi- Khandala..Where The Hungry Monkeys & Dogs Were Fed With Seengdanas.. Chana Dal..Bhuttas (Maize) & Biscuits Under The Leadership Of President Ln Suraiya Wadiwala.. Team Supremos Was Led By Dist Chairperson (20-21)-Jeev Daya Ln Apoorva Lohar \r\nA Consistent Activity Since Last 157 Days By Team Lonavala Supremos.', 10, 'false', 50, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Rajmachi, Khandala', 5099270, 122786, 0, ''),
(1135, 2000, 'Animal Feeding in Covid-19 Pandamic', 'Khandala', '2020-09-06', 'Apoorva Lohar', 'Dear Supremos & Well Wishers Good Evening.... Revival On 154 th Day Of Our Ongoing Activity Of Feeding The Stray Animals..Today Evening Sunday 6th Aug.. After A Gap Of 30 Days (Due To Heavy Rainfall) Team Supremos Visited Rajmachi- Khandala..Where The Hungry Monkeys & Dogs Were Fed With Seengdanas.. Chana Dal..Bhuttas (Maize) & Biscuits Under The Leadership Of President Ln Suraiya Wadiwala.. Team Supremos Was Led By Dist Chairperson (20-21)-Jeev Daya Ln Apoorva Lohar \r\nA Consistent Activity Since Last 154 Days By Team Lonavala Supremos..ðŸ™ðŸ™\r\nSurely See How The Monkeys Climbed Over On Ln Suraiya & Ln Apoorva..They Were Maybe So Excited To See Us After A Long Break.', 12, 'false', 50, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Rajmachi, Khandala', 5099270, 122786, 0, ''),
(1136, 5500, 'Donation for Langer in Gurudwara', 'Lonavla', '2020-09-06', 'Girish Parakh', 'Respected Supremo Members & Well Wishers....Today Sun 6th Sept 2020 Our Club Donated Rs 5500/- To The Gurudwara Lonavala For Their Langar.. This Donation Was Sponsored By Our Home Club Member & Zone Chairperson Ln Girish Ji Parakh.\r\nActivity Of Donation Conducted Under The Leadership Of President Ln Suraiya Wadiwala.', 5, 'false', 150, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Gurudwara', 5099270, 122786, 0, ''),
(1137, 56000, 'Annajdan on Occasion of Teachers Day ', 'Lonavla', '2020-09-05', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers..Today Sat 5th September On The Occasion Of Teachers Day Our Club Had Organized Anaj Daan (Distribution Of Ration Kits) To 30 Families To Last Them For A Month..(Our Worthy Dist Governor\'s Prgrm)\r\nThe Previlege Of Distributing These Kits Were Given To The 7 Invited Teachers Who Were Also Felicitated On The Occasion Of Teachers Day.. These Ration Kits Were Sponsored By Our Club Well Wisher Mr Altaf Usman Khan....\r\nThe Teachers Present For This Activity & Felicitations Were..\r\nMiss Apsara..From Reywood International School..\r\nMrs Munira Rampurwala..Principal First Step School..\r\nShri Pravin Gurav Sir..From Gurukul School..\r\nLn Shri Sachin Kute Sir..From City Pride School..\r\nLn Mrs Arpita Kute..From City Pride School..\r\nLn Mrs Poonam Martin Ma\'am (Retrd Teacher)..\r\nShri Zori Sir..Principal V.P.S High School..\r\nThis Activity Was Conducted Under The Leadership Of President Ln Suraiya Wadiwala & Activity Chairperson Was Ln Sachin Kute.', 20, 'true', 175, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Lonavla', 5099270, 122786, 0, ''),
(1138, 6000, 'Celebration of Mohram', 'Lonavla', '2020-08-28', '', 'Respected Supremo Members....Good Morning.. Yesterday Friday 28th Aug Our Club  Distributed Milk Sharbat & Rose Modaks (Niyaaz/Prasad) To All 60 Inmates & Staff Of Covid Care Centre-Jhalawadi Sanatorium..Lonavala..On The Occassion & To Commemorate 8th Muharram (The Mourning Period Of Shia Muslims)..\r\nThis Niyaaz/Prasad Was Sponsored By Our Club President Ln Suraiya Wadiwala....& Modaks By Zone Chairperson Ln Girish Parakh..\r\nThe Activity Was Executed In The Presence Of Zone Chairperson Ln Girish Parakh.. Attended By Club President Ln Suraiya Wadiwala..Club Treasurer & Cabinet Officer Ln Apporva Lohar..Ln Ameen Wadiwala..Ln Sanjay Lohar & Ln Vishal Chopda.\r\nLn Dr Aaliya (CMO)..Ln Javid Sir (MCF) & Other Doctors & Staff Of Covid Care Centre-Lonavala Were Present For This Activity.', 15, 'false', 70, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Center', 5099270, 122786, 0, ''),
(1139, 6500, 'Ganesh Pooja', 'Lonavla', '2020-08-22', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers....Our Club Yesterday Saturday 22nd August On The Day Of Ganesh Stahpna Organized Ganesh Pooja At Covid Care Centre-Jhalawadi Sanatorium.. This Pooja Was Initiated By Our Ln Member & Chief Commando CCC Ln Javid Ali Bhai & His Wife Ln Dr Aaliya (Chief Medical Officer-Covid Care Centre-Lonavala)..\r\nLn Vishal Chopda Arranged For All Material & Prasad For The Pooja For All Present & Also For The Inmates (Patients) Of Covid Care Centre-Lonavala..\r\nSurely See The Beautiful Video Of The Aarti (Pooja) Created By Ln Vishal Chopda.', 15, 'true', 70, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Center', 5099270, 122786, 0, ''),
(1140, 15000, 'Adoption of Girl Student for Education', 'Lonavla', '2020-08-19', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers....Under Our Worthy District Governor Ln Abhay Ji Shastri\'s Prgrm SARITA Our Club Today Wed 19th Aug Adopted & Sponsored A Girl Student Kanchan For Her Higher Education (Fy BA To Ty BA-3 Years).. We  Handed Over The Amount For Fees For The College Today Wed 19th August To The Girl Students Father Shri Moolchand.. This Fee & Adoption Has Been Done & Sponsored By Club President Ln Suraiya Wadiwala..\r\nPresent For This Activity Were President Ln Suraiya Wadiwala..Club Sec Ln Ranjana Puttol..Treasurer & Cabinet Officer Ln Apporva Lohar.. Cabinet Officer Ln Ameen Wadiwala..Ln Sanjay Lohar..1st VP Ln Vishwanath Puttol..Leo President Shourya Puttol..Leo Director Gargi Kute & Leo Member Khushi Puttol.', 6, 'true', 1, 'DISTRICT ACTIVITIES', 'Adoption of Girl Student', 'Adoption of Girl Student', 'Lonavla', 5099270, 122786, 0, ''),
(1141, 1500, 'Animal Feeding in Covid-19 Pandamic', 'Lonavla', '2020-08-10', 'Apoorva Lohar', 'Dear Supremos & Well Wishers Good Evening.... 158 th Day Of Our Ongoing Activity Of Feeding The Stray Animals..Today Evening Wednesday 10th Aug.. Team Supremos Visited Rajmachi- Khandala..Where The Hungry Monkeys & Dogs Were Fed With Seengdanas.. Chana Dal..Bhuttas (Maize) & Biscuits..Coincidentally Today We Even Found A Hungry Cat & Fed Her Buiscuits..Under The Leadership Of President Ln Suraiya Wadiwala.. Team Supremos Was Led By Dist Chairperson (20-21)-Jeev Daya Ln Apoorva Lohar \r\nA Consistent Activity Since Last 158 Days By Team Lonavala Supremos..', 4, 'false', 50, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Rajmachi, Khandala', 5099270, 122786, 0, ''),
(1142, 1, 'Recognition of LCO Supremos by PMO Office New Delhi', 'Lonavla', '2020-08-15', 'Ameen Wadiwala', 'Respected Supremo Members/Well Wishers/Governor Sir/VDG 1 & 2 Sir.. Proud To Announce That A Song On Frontline Corona Warriors Inaugurated By Hon PM Shri Narendra Modi Ji Is Released Today 15 th Aug.... And We Team Supremos Are Proud Because Our Club Activity As Corona Frontline Warriors Has Been Incorporated In This Song & At The End Of The Song Special Thanks Has Been Mentioned To Our Club President Ln Suraiya Wadiwala & Lions Club Of Lonavala Supremos For Service To Humanity..\r\nOur Club Members Namely President Ln Suraiya Wadiwala..Ln Arpita Kute..Ln Apporva Lohar..Ln Radha Sali & Ln Girish Parakh Are Also Clearly Visible In This Song (Activity Clip).. A Proud Momentv For Team Supremos & The Entire Faternity Of Lions & Specially Lions Of  Dist 3234 D2.... Plz Surely Watch This Song Till The End.. Thnx..Regards & Happy Independence Day To All', 50, 'true', 7700, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lonavla', 5099270, 122786, 0, ''),
(1143, 5000, 'Rescue of Old women on road', 'Lonavla', '2020-08-14', 'Ameen Wadiwala', 'Hats off Ln Aminbhai & Ln Vishwanath Puttol..\r\n(From LCO Lonavala Supremos)..\r\n\r\nOn 14th August night I got a call from Aminbhai Wadiwala asking for any shelter home.  \r\nActually he came to know about a old homeless woman lying on road side. He went there gave that woman food....bedsheet & Quilt.. \r\nThat Woman Was Completely Drenched In Heavy Rainfall & Was Not Even Able To Get Up..\r\nAmin Bhai Talked to local police asked for one night shelter.  Meanwhile he called me at about 11pm asking for any shelter home in PCMC. Then I with help of Ln Bhau Kokane shared one address and phone number of Prerana bhavan at Wakad. \r\n\r\nNext day on 15th August Amin bhai & Puttol again visited police station to know the status of that woman. Meanwhile member of LC Lonavala Supremo Ln Vishwanath Puttol recognized that woman and then both of them found out the home and relatives of that woman. With the help of police Aminbhai convinced relatives and requested them to take her away with them. \r\nAnd thus Ln Aminbhai & Ln Vishwanath saved one life of one poor and helpless woman.  \r\n\r\nI think this is real celebration of our Independence Day.  \r\n\r\nCongratulations and Thanks Ln Aminbhai and friends.', 10, 'false', 5, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Lonavla', 5099270, 122786, 0, ''),
(1144, 3500, 'Flag Hosting and Mithai Distribution', 'Lonavla', '2020-08-15', '', 'Respected Supremo Members & Well Wishers....Today 15th August On The Occasion Of Independence Day Our Club President Ln Suraiya Wadiwala Was Invited By The RPF-Lonavala For Flag Hoisting..\r\nChief Inspector RPF-LONAVALA Shri Parihar Sir & Club President Ln Suraiya Wadiwala Jointly Hoisted Our National Flag.... Present On This Proud Occasion Was The Complete Team Of RPF-LONAVALA.. Our Club Sec Ln Ranjana Puttol..Club Treasurer & Dist Cabinet Chairperson (Jeev Daya) Ln Apoorva Lohar..Our Leo President Shourya Puttol..Zone Chairperson Ln Girish Ji Parakh & Other Team Supremo Members.. Team Supremos Distributed Mithai To All Present For This Flag Hoisting Ceremony.', 15, 'false', 50, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Lonavla', 5099270, 122786, 0, ''),
(1145, 3500, 'Flag Hosting and Mithai Distribution', 'Lonavla', '2020-08-15', '', 'Respected Supremo Members & Well Wishers....Today 15th August On The Occasion Of Independence Day Our Club President Ln Suraiya Wadiwala Was Invited By The RPF-Lonavala For Flag Hoisting..\r\nChief Inspector RPF-LONAVALA Shri Parihar Sir & Club President Ln Suraiya Wadiwala Jointly Hoisted Our National Flag.... Present On This Proud Occasion Was The Complete Team Of RPF-LONAVALA.. Our Club Sec Ln Ranjana Puttol..Club Treasurer & Dist Cabinet Chairperson (Jeev Daya) Ln Apoorva Lohar..Our Leo President Shourya Puttol..Zone Chairperson Ln Girish Ji Parakh & Other Team Supremo Members.. Team Supremos Distributed Mithai To All Present For This Flag Hoisting Ceremony.', 15, 'false', 50, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Lonavla', 5099270, 122786, 0, ''),
