(1147, 45400, 'Activities during Installation', 'Lonavla', '2020-08-08', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers....During The Installation Ceremony On 8th Aug 2020 Zone Chairperson Ln Girish Ji Parakh (Our Home Club Member) Donated  Rs 5400/- To The Gurudwara-Lonavala For Langar During This Time Of Carona Crisis..Rs 10000/- To Jito Pune & Rs 3000/- Each Month For Our On Going Club Activity Of Feeding Hungry Animals (An Initiative By Our Club & District Chairperson-Jeev Daya) Ln Apoorva Lohar.\r\nThese Cheques Were Handed Over To Club President Ln Suraiya Wadiwala In The Presence Of Installation Officer Our Worthy VDG-1 MJF Ln Hemant Ji Naik To Be Disbursed Accordingly.', 120, 'true', 650, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Lonavla', 5099270, 122786, 0, ''),
