(1149, 576000, 'Distribution of Ayush Quath Kadha Powder', 'Lonavla', '2020-08-03', '', 'Respected Supremo Members & Well Wishers..Today Monday 3rd August 2020 Lions Club Of Lonavala Supremos Distributed Sachets (4800 Packs) Of Immunity Booster Kaada (AAYUSH QUAT) To....\r\n1) Total Staff & Officers Of Lonavala Sahakari Bank Ltd-Lonavala..In The Presence Of Zonal Head Shri Ajit Gamande Sir & Branch Manager Shri Kulkarni Sir..\r\n2) Residents Of Porter Chawl-Lonavala..\r\nThese Sachets Of AAYUSH QUAT (Immunity Booster Kaada) Were Sponsored By Our Incoming Member The Noble & Generous Shri Vishal Chopda.... Under The Leadership Of President Ln Suraiya Wadiwala.. Team Supremos Was Led By Club Treasurer & Cabinet Officer Ln Apoorva Lohar..\r\nPresent For This Activity Were.. Sponsorer Shri Vishal Chopda..Ln Apoorva Lohar..Ln Jayram Gowda..Ln Sanjay Lohar & Cabinet Officer Ln Ameen Wadiwala..\r\nThe Fight To Eradicate The Deadly Corona Virus (Covid-19) From Lonavala Town By Team Supremos & Supported By Shri Vishal Chopda..ðŸ™', 100, 'true', 240000, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. More Than 10000)', 'Lonavla', 5099270, 122786, 0, ''),
