(1151, 1, 'Felicitation as Corona Warrior to Club and President', 'Lonavla', '2020-07-28', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers Good Evening..\r\nA Proud Moment For Our Club\r\nLions Club Of Lonavala Supremos & Club President Ln Suraiya Wadiwala & Members Of Our Club Were Today Tuesday 28th July 2020 Felicitated By Shiv Sena Lonavala Shaher With A Trophy & Appreciation Certificate For The Meticulous & Selfless Work As Corona Frontline Warriors During This Period Of Corona Crisis.. This Felicitation Was Done At The Hands Shiv Sena Lonavala Shaher Pramukh Shri Badasaheb Phatak & Other Senior Office Bearers Of Shiv Sena Party In The Presence Of Zone Chairperson Ln Girish Parakh.. Hard Work & Selfless Service During This Crucial Period Of Covid-19 Of Team Supremos Was Recognized By The Shiv Sena Party Who Termed Lonavala Supremos As Front Line Corona Warriors..\r\nOur Member Ln Sanjay Ji Lohar (Senior Loco Pilot-C.R) Was Also Individually Felicitated With An Appreciation Certificate As A Front Line Corona Warrior.. He Has Been Without Any Fear Working Day & Night With Team Supremos As Well As With C.R Too In The Absence Of Staff In This Crucial Period..\r\nTeam Supremos Is Humbled To Be Termed As Frontline Corona Warriors & Are Also Proud Of Our Member Ln Sanjay Lohar & The Whole Team Supremos On This Felicitation.', 5, 'true', 15, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lonavla', 5099270, 122786, 0, ''),
