(1154, 10000, 'Distribution of Ayush Quath Kadha Powder and Books ', 'Lonavla', '2020-07-24', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers.... Today Friday 24th July 2020.. Our Club..Lions Club Of Lonavala Supremos Conducted 2 Activities In A Row Our Club Distributed Sachets Of Immunity Booster Kaadha (AAYUSH QUAT) To Fight Corona Virus Infections.... These Sachets Were Sponsored By Our Incoming Member The Noble Shri Vishal Chopda From Chopda Corner..Bazaar Peth-Lonavala.... These Sachets Were Distributed Free Of Cost To The Front Line Corona Warriors.. Namely Staff & Doctors Of Sadhu Vaswani Ashram-Khandala..In The Presence Of Shri Lal Advani Sir..\r\nThis Distribution Was Done At Sadhu Vaswani Ashram-Khandala....\r\nAfter This The 2nd Activity Was Conducted At Covid Care Centre, Jhalawadi Sanitorium- Lonavala Where Team Supremos Donated Reading Books (Hindi-Marathi & English) For The Inmates Of The Covid Care Centre At Jhalawadi Sanitorium & Also Immunity Booster Kaada Sachets (AAYUSH QUAT) For The Inmates & Team Of Doctors There..\r\nDr Aaliya..Dr Dolly Agarwal & Police Commando Shri Javid Ali Were Present To Receive The Above.. Under The Leadership Of President Ln Suraiya Wadiwala....Team Supremos Was Led By Club Treasurer & Cabinet Officer Ln Apoorva Lohar', 15, 'false', 200, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. More Than 10000)', 'Zhalawadi Covid Center', 5099270, 122786, 0, ''),
