(1168, 1, 'Felicitation as Corona Warrior', 'Lonavla', '2020-07-06', '', 'Respected Supremo Members & Well Wishers.... Today Monday 6th July 2020 Our Club Lions Club Of Lonavala Supremos Felicitated Our Lonavala City Police Station Police Inspector Shri Manoj Kumar Ji Yadav With A Appreciation Momento & A International Certificate For His Selfless Service & Dedication Towards His Duty In This Hour Of Carona Crisis.... During This Crucial Period Of Covid-19 He Has Given His Best As A Frontline Warrior Managing All Untoward Situations In Lonavala In The Best Ways & With Perfection.. The Felicitation took place At Lonavala City Police Station.... Under The Leadership & In Presence Of President Ln Suraiya Wadiwala & Activity Chairperson Ln Sagar Tawre.. Team Supremos Was Led By Club Sec Ln Ranjana Puttol.... Also Present For This Felicitation Were Zone Chairperson Ln Girish Parakh..1st V.P Ln Vishwanath Puttol & Ln Ameen Wadiwala.', 10, 'true', 12, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lonavla', 5099270, 122786, 0, ''),
(1169, 1, 'Felicitation of Corona Warrior', 'Lonavla', '2020-07-01', 'Apoorva Lohar', 'Respected Governor Sir/Region Chairperson/ Friends/Well Wishers & Team Supremos..Our Club Lions Club Of Lonavala Supremos Today Wednesday 1st July 2020..The 1st Day Of Lionistic Year 2020-21 On The Instructions Of Our Worthy District Governor MJF Ln Abhay Ji Shastri Felicitated CORONA WARRIORS In All With Appreciation Trophies & Certificates Namely:- 1) Sadhu Vaswani Mission-Pune/Sadhu Vaswani Ashram-Khandala (NGO)..\r\n2) Chief Commando- Shri Sayyed Javid Kalim From Lonavala City Police Station (Police)..\r\n3) Shree Swami Samarth  Chile Shankar Maharaj Mandal-Bhangarwadi.. Lonavala (NGO)..\r\n4) Hon Smt. Surekha Jadhav Madam (President-Lonavala Municipal Council) & Hon.Shri Shridhar Poojari (V.President Lonavala Municipal Council)..(Govt Authorities) For Their Meticulous Hard Work, Sincere Dedication & Round The Clock Selfless Service To The Residents Of Lonavala During This On Going Crisis Of Covid-19..\r\n5) Sunni Muslim Jamat..Shri Hanif Bhai & Team (Muslim Trust)..\r\n6) Dr Seema Shinde (Doctor)\r\n7) Ln Sanjay Lohar (On Behalf Of Loco Pilots- C.R Lonavala..Frontline Warriors)..\r\n8) Shri G.S Parihar-Chief Police Inspector-RPF Lonavala.\r\nThis Activity Was Executed Under The Leadership Of President Ln Suraiya Wadiwala & Team Supremos Was Led By Activity Chairperson Ln Sagar Tawre.. Supported p& In The Presence Of Zone Chairperson Ln Girish Parakh.', 10, 'true', 8, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lonavla', 5099270, 122786, 0, ''),
