(1171, 36000, 'Aanajdan', 'Lonavla', '2020-07-05', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers..Good Eve.. Today Sunday 5th July Our Club Lions Club Of Lonavala Supremos Distributed Ration Kits (To Last For More Than A Month) To 18 Needy Families Of Lonavala These Ration Kits Were Sponsored By Our Club Well Wisher Shri Altaf Khan & Fly....\r\nThis Activity Was Executed At The Residence Of Ln Sanjay Ji Lohar....\r\nUnder The Leadership Of President Ln Suraiya Wadiwala Team Supremos Was Led By\r\nActivity Chairperson Ln Arpita Kute.\r\nAlso Present For This Activity Were Zone Chairperson Ln Girish Parakh.. Sec Ln Ranjana Puttol.. Treasurer Ln Apoorva Lohar.. Ln Vishwanath Puttol.. Ln Sagar Tawre.. Ln Sanjay Lohar.. Ln Chetna Lohar..*Ln Uday Shetty..Ln Sachin Kute..Ln Ameen Wadiwala & Club Well Wisher Smt Indumati Lohar.. Guests Present For This Activity Were Shri Prashant Puranik (Journalist-Amber) & Mrs Madhura Puranik- Front Line Corona Warrior From Sasoon Hospital-Pune.', 15, 'true', 90, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Lonavla', 5099270, 122786, 0, ''),
