(1173, 1500, 'Animal Feeding in Covid-19 Pandamic', 'Khandala', '2020-07-03', 'Apoorva Lohar', 'Dear Supremos & Well Wishers.... Good Evening....Today Evening Friday 3rd July..The Third Day Of Lionistic Year 2020-21 Team Supremos Visited Rajmachi- Khandala Where Monkeys & Cows Were Fed With Seengdanas..Chana Dal..Bananas & Mangoes..Under The Leadership Of President Ln Suraiya Wadiwala.... Team Supremos Today Was Led By Club\'s Secretary Ln Ranjana Puttol....Our Leo\'s Khushi & Shourya Also Participated..Ln Apoorva Lohar (Dist Chairperson 2020-21-Jeev Daya Portfolio) Guided The Activity Today....\r\nA Consistent Activity Since Last 94 Days By Team Lonavala Supremos..ðŸ™ðŸ™', 10, 'false', 50, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Rajmachi, Khandala', 5099270, 122786, 0, ''),
