(1176, 5500, 'Annajdan on occasion of October Service Week', 'Lonavla', '2020-10-03', 'Girish Parakh', 'Respected Supremo Members & Well Wishers.... Today Sat 3rd Oct 2020.. The 2nd Day Of Oct Service Week-Seva Sarita..Team Supremos Donated Bags Of Rice & Cooking Oil Cans (Anaaj Daan) To Hope House Orphanage, Nangargaon-Lonavala..\r\nThis Anaaj Daan Was Sponsored By Ln Girish Ji Parakh In Memory Of His Dad Late Dhanraj Ji Parakh..... Under The Leadership Of President Ln Suraiya Wadiwala..Team Supremos Was Led By Activity Chairperson Ln Dhirendra Chowakikar.', 15, 'false', 50, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Lonavla', 5099270, 122786, 0, ''),
(1177, 5000, ' Nutrisious Food Kits For Malnourished Children', 'Talegaon', '2020-10-02', 'Suraiya Wadiwala', 'Respected Supremo Members & Well Wishers..... Yesterday Fri 2nd Oct LCO Talegaon had held various activities wherin by 1 activity was Provision Of 200 Nutrisious Food Kits For Malnourished Children Of An Institution Of Talegaon.... In those kits Our Generous Home Club Member & Zone Chairperson Ln Girish Ji Parakh Who Was Invited On This Occasion Sponsored & Donated 200 packets Of Chikki For Each Child....\r\nA very good Activity By LCO TALEGAON Supported By LCO LONAVALA SUPREMOS.', 20, 'true', 50, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Talegaon', 5099270, 122786, 0, ''),
(1178, 2500, 'Swach Sarvection ', 'Lonavla', '2020-10-02', 'Suraiya Wadiwala', 'Respected Supremo Members & Well Wishers..... Fri 2nd Oct The 1st Day Of Oct Service Week-Seva Sarita Team Supremos Jointly With Lonavala Municipal Council Conducted A Swachata Abhiyan At Sahara Bridge Till Before Ram Nagar.... Team Supremos Is Partnering LMC In The Prgrm Swach Sarvekshan-2021....\r\nOur Leo\'s President Shourya Puttol & Leo Aayush Gowda Also Participated In This Swachata Abhiyan....\r\nUnder The Leadership Of President Ln Suraiya Wadiwala Team Supremos Was Led By Activity Chairperson Ln Uday Shetty.', 30, 'true', 100, 'DISTRICT ACTIVITIES', 'Swachchha Nadiya', 'Swachchha Nadiya', 'Lonavla', 5099270, 122786, 0, ''),
(1179, 2000, 'Ayush Kadha Distribution', 'Lonavla', '2020-10-02', 'Apoorva Lohar', 'Respected Supremo Members & Well Wishers..... Lonavala Supremos Today Friday 2nd Oct 2020....The First Day Of Oct Service Week-Seva Sarita.. Delivered Immunity Booster Kaada (Ready To Drink-60 Glasses) For Patients..Staff & Doctors Of Covid Care Centre-Jhalawadi-Lonavala.. Further On This Immunity Booster Kaada Will Be Delivered Each Evening To The Covid Care Centre-Lonavala On The Request Of The Doctors As This Kaadha Freshens Up The Patient\'s & Raises Their OÂ² Levels & Helps In Making Their Immunity Stronger....\"Consecutive  17th Day Of This Activity\" This Activity Will Be Carried On Each Evening Under The Leadership Of President Ln Suraiya Wadiwala & Guidance Of Zone Chairperson Ln Girish Ji Parakh..\r\nActivity Chairperson For This Activity Is Ln Chetna Lohar Who Herself Prepares This Kaada At Home Each Evening.', 10, 'false', 60, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Center', 5099270, 122786, 0, ''),
