(1185, 2000, 'Service to Covid-19 Patients', 'Lonavala', '2020-09-15', 'Apoorva Lohar', 'Respected Supremo Members & Well Wishers....Proudly Stating That *Our Club Treasurer & Cabinet Officer (Jeev Daya) Ln Apoorva Lohar* Was Called By *Covid Care Centre-Jhalawadi-Lonavala For Conducting Rapid Antigen Tests (RAT) On Tue 15th Sept....* She *Conducted This Test On Suspected Covid Patients From 10.30 in The Morning Till 3 pm in the Afternoon..* We Team Supremos Proudly State.. *Where There Is A Need There Is Lion Supremos.*', 6, 'no', 45, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Care Center', 5099270, 122786, 0, ''),
(1186, 6000, 'Service to Covid-19 Patients', 'Lonavla', '2020-09-22', 'Suraiya Wadiwala', 'Respected Supremo Members & Well Wishers....Proudly Stating That *Our Club President Ln Suraiya Wadiwala..Club Treasurer & Cabinet Officer (Jeev Daya) Ln Apoorva Lohar & Clubs Prospective Member Prathmesh Gurav* Were Called & Requested By *Covid Care Centre-Jhalawadi-Lonavala For Conducting Rapid Antigen Tests (RAT) On Tuesday 22nd Sept....* They Together *Conducted This Test On Suspected Covid Patients From 10.30 in The Morning Till 4.30 in the Evening..* We Team Supremos Proudly State.. *Where There Is A Need There Are Lion Supremos.*', 18, 'no', 90, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Care Center', 5099270, 122786, 0, ''),
(1187, 4000, 'Service to Covid-Patients', 'Lonavala', '2020-09-30', 'Apoorva Lohar', 'Respected Supremo Members & Well Wishers....Proudly Stating That *Our Club Treasurer & Cabinet Officer (Jeev Daya) Ln Apoorva Lohar & Prospective Supremo Member Prathmesh Gurav* Were Called By *Covid Care Centre-Jhalawadi-Lonavala For Conducting Rapid Antigen Tests (RAT) On Thu 30th Sept....* They *Conducted This Test On Suspected Covid Patients From 10.30 in The Morning Till 2.30 in the Afternoon..* We Team Supremos Proudly State.. *Where There Is A Need There Is Lion Supremos.*', 12, 'no', 70, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Care Center', 5099270, 122786, 0, ''),
(1188, 2000, 'Service to Covid-19 Patients', 'Lonavla', '2020-10-01', 'Apoorva Lohar', 'Respected Supremo Members & Well Wishers....Proudly Stating That *Our Club Treasurer & Cabinet Officer (Jeev Daya) Ln Apoorva Lohar* Was Called By *Covid Care Centre-Jhalawadi-Lonavala For Conducting Rapid Antigen Tests (RAT) On Thu 1st Oct....* She *Conducted This Test On Suspected Covid Patients From 10.30 in The Morning Till 2.30 in the Afternoon..* We Team Supremos Proudly State.. *Where There Is A Need There Is Lion Supremos.*', 6, 'no', 30, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Care Center', 5099270, 122786, 0, ''),
(1189, 1, 'Jeev Daya Snake Rescue', 'Lonavla', '2020-10-03', 'Apoorva Lohar', 'Respected Supremo Members & Well Wishers....Proudly Stating That *Our Club Treasurer & Cabinet Officer (Jeev Daya) Ln Apoorva Lohar* was informed *Today 3rd Oct* that there was a *Snake in the parking of Aadarsh Colony-Lonavala....* *She Along with Club President Ln Suraiya Wadiwala..Club Members Ln Javid Sayyad & Ln Dhirendra Chowakikar reached there..* Ln *Apporva Lohar Caught hold of the Snake* & *Took it far off & Left It In it\'s Natural Habitat.....* Indeed *Ln Apporva Lohar Is Jeev Daya.. *Team Supremos Are Everywhere & Where Ever Needed.*', 3, 'no', 4, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Nangargaon', 5099270, 122786, 0, ''),
(1190, 30000, 'Students Speech Compitition', 'all maharastra', '2020-09-05', 'Ln.Manoj Bhalgat', 'Because Of COVID 19 all schools are closed hence students doesnot participates in speech compititions which were arrange by schools on Teachers Day % September .So our club decide to arrange this compitition  Online.Students recorded their speech on given subjects and uploaded on Lions club of Junnar Shivaneri facebook page .The subjects given as their age group. There were five groups having different  subjects but all subjects were related to teacher respective.In this compitition 135 students participated.', 35, 'false', 15, 'DISTRICT ACTIVITIES', 'Teach Value Education', 'Teach Value Education (1 School)', 'Facebook', 3965348, 57721, 0, ''),
(1191, 3000, 'Felicitation Of Engineer', 'Junnar  ', '2020-09-15', '', '15 September is Engineer day . so we felicitated our club members who are Engineer. Ln milind Zagade president, Ln. Bandu Karpe Treasurer Ln. Sanjay Gandhi, Ln. Santosh Jadhav, Ln. Sandeep Bangar, Ln. Anil Jadhav all theseare our club members.', 10, 'false', 7, 'EVENT CELEBRATION', 'Others', 'Others', 'Junnar', 3965348, 57721, 0, ''),
(1192, 20000, 'Plasma Donation', 'Chinchawad', '2020-09-25', 'Ln.Manoj Bhalgat', 'Lions club of Junnar Shivaneri started PLASMA DONATION CAMPAINGN since 15 days. We are helping poor and needy patients through this campaign.We are  doing this great cause in co-operation with Moraya Blood Bank Chinchawad.Our club has helped and supplied blood pasma to 27 covid patients.All of them are very fine now. We did all the hard work on Plasma donors sush as to trace them to find antobodies in them, to take blood samples etc. We did all the expeditures on them. The covid patients who have developed antibodies came forwar and helpd our Lions Club in such a great cause very enthusiastically.We are working very hard on this campaign si that it can go a very long way.In future oue target is to help as many patients as possible so that the mortality rate can remains zero in Junnar Taluka. We hopes God will give all of us enough strength to serve poor and needy people from our society.', 30, 'true', 25, 'MEDICAL ACTIVITIES', 'Blood Donation', 'Blood Donation', 'Moraya Blood Bank Chinchawad', 3965348, 57721, 0, ''),
(1193, 7000, 'Teachers day', 'Junnar', '2020-09-05', 'Ln.Manoj Bhalgat', 'On the Occasion of Teachers day we felicitated 250 teachres who are teaching online even if schools are closed.To each teacher gave one rose flower and one certificate to felicitate them on this day. This day is very important in teachres life,this day is also bithday of Dr. savvepalli Radhakrishnan.', 30, 'false', 250, 'EVENT CELEBRATION', 'Others', 'Others', 'Shankarrao Butte Patil English medium Junnar, SBP school Junnar, Annasaheb Aavate vidyalaya Junnar , ZP\'s school Panchayat samiti Junnar', 3965348, 57721, 0, ''),
(1194, 1, 'Jeevdaya Snake rescue', 'Lonavla', '2020-09-26', 'Apoorva Lohar', 'Respected Supremo Members & Well Wishers....On *Sat 26th Sept 2020....Ln Apporva Lohar-Cabinet Officer (Jeev Daya)* Was *Called By The Covid Care Centre-Jhalawadi-Lonavala....* To *Catch A Huge Snake Which Had Entered The Covid Care Centre-Jhalawadi....* She Immediately Reached With One Of Her Aides..\n*Caught the snake Who was hurt & had wounds....* She Immediately *applied Medicines & Haldi Powder on the wounds* & *Left The Snake Far Off In It\'s Natural Habitat....*\nIndeed *She\'s Jeev Daya..*\nMaking Team Supremos Proud Each Time.', 2, 'no', 4, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Lonavala', 5099270, 122786, 0, ''),
(1195, 1, 'Felicitation of Corona Warrior', 'Lonavla', '2020-09-10', 'Ameen Wadiwala', 'Respected Supremo Members... *Ln Javid Sayyad (Chief Commando Lonavala City Police Station) & Ln Dr Aaliya Sayyad (Chief Medical Administrator-Covid Care Centre-Jhalawadi)* Who Are *Both Incharge Of This Covid Centre* & Are *Working & Giving Their Services Round The Clock* Were *Awarded With Appreciation Certificates  By Lonavala Municipal Council* At The Hands Of *Smt Surekha Jadhav Madam (Hon President LMC).....* A *Proud Achievement By Members Of Team Supremos.*', 6, 'yes', 2, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Municipal Council', 5099270, 122786, 0, ''),
