(1372, 6400, 'Corona awareness and mask distribution', 'Pune', '2020-10-03', '', 'Lions Club of Poona Nigdi procured 400 masks valued at Rs. 6400 and distributed those for free to the needy people of slums near Bijlinagar, Akurdi, Pune. The members also created awareness among those people about social distancing, correct use of masks and its benefits as protection from the Covid-19 virus. RC MJF Lion Sudam More and ZC Lion Dilipsinh Mohite, along with the President, Secretary, Jt. Secretary and other members of the club were present for this activity.', 22, 'false', 10, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Bijlinagar', 4893941, 46113, 0, ''),
(1374, 15500, 'Blood Donation Camp', 'Pune', '2020-10-04', 'DG MJF Lion Abhay Shastri, PDG MJF Lion Omprakash Pethe, RC MJF Lion Sudam More and ZC Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi, with the help of the Club\'s charitable trust, organised a blood donation camp at LCP Nigdi Club house. The event was organised under the leadership of 2D MJF Lion Hari Nair, President of the charitable trust, and other office bearers of the trust as a Signature Activity for the 33rd consecutive year. A total of 25 people donated blood among whom, 12 were the members of LCP Nigdi. DG MJF Lion Abhay Shastri, First Lady of district, PDG MJF Lion Omprakash Pethe, RC MJF Lion Sudam More, ZC Lion Dilipsing Mohite, President, Secretary, Jt. Secretary and other members of the club were present for this activity.', 114, 'true', 25, 'MEDICAL ACTIVITIES', 'Blood Donation', 'Blood Donation', 'LCP Nigdi Club House', 4893941, 46113, 0, ''),
(1375, 11500, 'Adoption of girl child for education', 'Pune', '2020-10-05', '', 'Lion Geeta Behera, on behalf of Lions Club of Poona Nigdi, donated an amount of Rs. 10,000 for education of girl children, to Pradeept Bharat Foundation NGO, Nigdi, engaged in adoption of tribal girls. President, Secretary and other Lion members celebrated the birthday of Lion Geeta Behera, Lion Rishikesh Musmade, Jt. Secretary and 2 tribal girls along with the NGO members and other girls. Sweets and snacks woth Rs. 1500 were distributed by Behera Family', 12, 'false', 2, 'DISTRICT ACTIVITIES', 'Adoption of Girl Student', 'Adoption of Girl Student', 'Pradeept Bharat Foundation', 4893941, 46113, 0, ''),
