(1384, 24800, 'LCO Nasik Star Installs Nirmalya Kalash', 'NASHIK', '2020-10-01', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To Keep Rivers Clean.\r\nLions club of Nasik star opens the October service week with a bang! \r\nActivity: Installation of Nirmalya Kalash at the hands of hon. MAYOR MR. SATISH KULKARNI \r\nUnder the SWACHA NADIYAN ABHIYAN (from the district governorsâ€™ program) Ln Prashant Bharbat and Ln Nilima Daware sprang into action to implement the activity.\r\n 2 NIRMALYA KALASH were installed, one at Gharpure ghat and the other at the bridge near Chopda lawns, inaugurated at the hands of the MAYOR, Mr.SATISH KULKARNI.\r\nThe mayor appreciated the endeavors undertaken by the club members and extended a hand of working together towards a common goal.\r\nThe club felicitated the MAYOR and his team with bird nests to promote the \' SAVE THE SPARROW CAMPAIGN\' \r\nGoing miles in spreading smiles....\r\nAchieving new heights \r\nWith clean rivers and clear skies\r\n', 40, 'true', 1000, 'DISTRICT ACTIVITIES', 'Swachchha Nadiya', 'Swachchha Nadiya', 'Nasik, Chopada Lawns and Gharpure Ghat.', 4520195, 97806, 0, ''),
(1385, 2000, 'Ayush Kadha Distribution', 'Lonavla', '2020-10-19', 'Suraiya Wadiwala', 'Respected Supremo Members & Well Wishers..... *Lonavala Supremos Today Monday 19th October 2020...Delivered *Immunity Booster Kaada (Ready To Drink-60 Glasses)* For *Patients..Staff & Doctors Of Covid Care Centre-Jhalawadi-Lonavala..* Further On *This Immunity Booster Kaada Will Be Delivered Each Evening To The Covid Care Centre-Lonavala On The Request Of The Doctors As This Kaadha Freshens Up The Patient\'s & Raises Their OÂ² Levels & Helps In Making Their Immunity Stronger....\"Consecutive  34th Day Of This Activity\" (1 Month Complete Of This Daily Activity)This Activity Will Be Carried On Each Evening Under The Leadership Of President Ln Suraiya Wadiwala & Guidance Of Zone Chairperson Ln Girish Ji Parakh..*\nActivity Chairperson For This Activity Is *Ln Chetna Lohar Who Herself Prepares This Kaada At Home Each Evening.*', 2, 'no', 70, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Zhalawadi Covid Care Center', 5099270, 122786, 0, ''),
(1386, 5500, 'LCO Nasik Star Concted Tech Talk Successfully', 'Nashik, Maharashtra', '2020-10-04', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware, Parmanandaji Sharma', 'Purpose of Activity: To Improve Online Teaching & Sharing Benefit with students studying.\r\nTECH TALK FOR TEACHERS, BY Ln.Dr. Amit Prabhu AND Ln. Santosh Kalantri. Close to 300 teachers of zilla parishad schools from Nasik taluka attended the program. They were briefed about various tools to improve online teaching and sharing to benefit students studying who are lagging behind in their studies due to corona pandemic. This was inaugurated by Cabinet secretary of the lionâ€™s district Ln. Parmanand Sharma. And attended by developmental officer of ZP Mr. Bhausaheb Thakre. Receiving an overwhelming response, the teachers in their feedback requested to take it to the next level by involving teachers from other talukas too.\r\n', 30, 'true', 280, 'OTHER IMPORTANT', 'Computer Education', 'Computer Education', 'ZOOM APP', 4520195, 97806, 0, ''),
(1387, 5500, 'LCO Nasik Star Conducts  Webinar on -Corona Fact Sheet', 'Nashik, Maharashtra', '2020-10-05', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware, PDGMjf LnVikrant Vaidya', 'Purpose of Activity: To Make aware about facts of COVID 19\r\nA webinar on corona and its management by Dr. Nitin Nere and Dr. Sophia Mohan, called as CORONA FACTSHEET organized by Lions Club of Nashik star. 91 attendees took the benefit of the session which lasted for two and half hours. All practical aspects related to the covid-19 pandemic and its management where handled very effectively buy the speakers Dr. Nitin Nere and Sophia Mohan. It was an interactive session where queries of the audience were handled up to their satisfaction. Means to prevent the spread of the disease and management techniques were discussed. overall a wonderful program that served its purpose completely. The doctors handled the queries of the attendees and gave practical points about handling the prevalent situation caused by the corona pandemic.\r\n', 50, 'true', 91, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'ZOOM APP', 4520195, 97806, 0, ''),
