(1398, 2500, 'LCO Nasik Star Conducted Bharat @100 Sucessfully', 'Nashik, Maharashtra', '2020-10-02', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To Know vision of young generation when India will complete 100yers of independence\r\n BHARAT@100: session 1\r\n Lions club of Nasik star executes phase one of the Bharat @100 with children of Brahmanwade school Trimbakeshwar on 2nd October, GANDHI JAYANTI\r\nThe concept of Bharat@ 100 was given to the students as an essay competition to the *8th,9th and 10th STD of Brahmanwade school. With nearly 40 entries,10 students were chosen as finalists.\r\nAn online zoom meeting was conducted with these children (Thanks to the 20 mobile phones donated by LCO Nasik star)\r\nA panel of 2 judges, Dr. Aparna Malegaokar and Ln. Nilima Daware along with other star members conducted a group discussion with these children to give them a platform to put forward their VISION for INDIA. Winners will be chosen on basis of their ideas, vocabulary and presentation. It was overwhelming to see these children staying in dire conditions at their residences but with aspirations soaring high.\r\nA great experience to see these children making constructive use of the gadgets donated to them by LCO Nasik star. \r\nGOING MILES IN SPREADING SMILES!\r\n', 40, 'true', 20, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'ZOOM PLATFORM', 4520195, 97806, 0, ''),
(1399, 4000, 'LCO Nasik Star Conducted Webinar On Personality Development  ', 'Nashik, Maharashtra', '2020-10-06', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware, DG Abhayji Shastri', 'Purpose of Activity: To motivate the students and bring out the best in them.\r\nTeam Nasik Star shines bright on Day 5 of OCTOBER SERVICE WEEK.\r\n More than 450 students today attended a session on\r\nUNLEASH YOUR DREAMS &\r\nMANIFEST YOUR POTENTIAL\r\nA two-hour session on personality development by eminent speaker and past district governor. Dr.JYOTI TOSHNIWAL was conducted on Zoom online Portal to motivate the students and bring out the best in them.\r\nThe 5 C\'s necessary for success...\r\n c hoice\r\n C omfort zone\r\n C ommitment-\r\n c an do attitude\r\n c hallenge\r\n C hannelise emotions \r\nwere discussed to an extremely positive feedback.\r\n', 40, 'true', 458, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'ZOOM PLATFORM', 4520195, 97806, 0, ''),
(1400, 2500, 'LCO Nasik Star Conducted Webinar : à¤µà¥à¤¯à¤•à¥à¤¤à¤¿à¤®à¤¤à¥à¤µ à¤µà¤¿à¤•à¤¾à¤¸: à¤˜à¥‡ à¤­à¤°à¤¾à¤°à¥€!!!', 'Nashik, Maharashtra', '2020-10-07', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To motivate the students and bring out the best in them.\r\nà¤µà¥à¤¯à¤•à¥à¤¤à¤¿à¤®à¤¤à¥à¤µ à¤µà¤¿à¤•à¤¾à¤¸: à¤˜à¥‡ à¤­à¤°à¤¾à¤°à¥€!!!\r\nMOTIVATIONAL PROGRAM FOR\r\nBRAHMANWADE SCHOOL CHILDREN by Ln.Abhay Bag.\r\nClose to 45 students and teachers of Bramhanwade Madhyamik Vidya Mandir. Attended a motivational talk by Worthy member of LC of Nasik star Ln. Abhay Bag. Located around 30 Kms from Nasik. The school functions in a small shanty house where 130 students receive education for 8 9 and 10th std, getting coached by 4 teachers who manage the entire admin of the school.\r\nThe programme was inaugurated by Past District Governor Ln. RAMESH SHAH. Who remembered his visit to the school and engaged the students with his speech which emphasized the value of education in today\'s world. He encouraged the teachers who impart their duties as real leaders without any remuneration.\r\nThis was followed by Ln. Abhay bags lecture in which he highlighted the characteristics of a successful personality. He highlighted the virtues that everyone should process to achieve success in life.\r\nLn. Nilima Dawre delivered the vote of thanks.\r\n', 34, 'true', 45, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'ZOOM PLATFORM', 4520195, 97806, 0, ''),
(1401, 15000, 'LCO Nasik Star Conducted Tax Mastery Course', 'Nashik, Maharashtra', '2020-10-08', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To Elaborate Tax Knowledge of Commerce Background Candidate.\r\nThe TAX MASTERY COURSE was inaugurated on the 21 of sept where in practical information and knowledge was imparted to 56 participants by faculties; CA Ln Ram Daware and CA ln Lalit Pawar online through zoom app. The course was conducted for 15 days in a row till the 8th of October when the closing ceremony was performed online. All the fees collected for the course by the club will be directed purely for social causes only. The last of this course was 8th of October. Where PDG Ln. Omprakash Pethe sir was invited as guest. \r\n', 50, 'true', 56, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'ZOOM PLATFORM', 4520195, 97806, 0, ''),
(1402, 0, 'TEACH VALUE EDUCATION', 'Pune', '2020-10-14', '', 'Gave motivational lecture at V.S. Satav School\r\nBy Ln. Rajesh Tekriwal\r\n', 1, 'false', 1, 'DISTRICT ACTIVITIES', 'Teach Value Education', 'Teach Value Education (1 School)', 'Pune', 2604283, 44129, 0, ''),
