(1404, 4000, 'LCO Nasik Star Conducted Art Of Living Programe @Bramhanwade School', 'Nashik, Maharashtra', '2020-10-10', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To Improve Focus and Concentration of Students.\r\nART OF LIVING program was conducted for the school children to mainly improve their focus. concentration techniques were taught to them in a unique way by Dr Aparna Malegaokar, Mr. Sachin and their team. The1.5 hr session was concluded on a vibrant, positive note with music and Satsang where the children, teachers, villagers and club members grooved on their toes in unison.\r\n', 30, 'true', 45, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(1405, 1000, 'LCO Nasik Star Conducts Prize Distribution ceremony Of Bharat @100', 'Nashik, Maharashtra', '2020-10-10', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'BHARAT @100 competition was held (2nd Oct, Gandhi Jayanti) for the school children regarding their vision for INDIA as it enters into its 100th year of freedom in 2047. nearly 40 students participated, out of which 10 were selected for the final round and an online group discussion was conducted, judged by Dr. Aparna Malegaokar and Ln. Nilima Daware. Medals and Certificates were distributed to the winners and participants on 10th of oct.', 30, 'true', 10, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(1406, 11000, 'LCO Nasik Star Donated Inverter To Bramhanwade School.', 'Nashik, Maharashtra', '2020-10-10', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To Donate Inverter for Smooth Functioning of School. \r\nThere is a frequent power failure in Brahmanwade village. Which affects school functioning. Students canâ€™t operate Computers and even no sufficient light in class rooms. this problem recognized by our guest Mr.& Mrs. Kulkarni. Hence, they decided to donate Inverter to Brahmanwade school through LCO Nasik Star for smooth functioning. And nearest time was October service week. This device is going supply uninterrupted electricity.   \r\n', 30, 'true', 105, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(1407, 4500, 'LCO Nasik Star Donates Mask', 'Nashik, Maharashtra', '2020-10-10', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To Provide safety in COVID19 Pandemic.\r\nMasks bearing lions logo were distributed to all the students of the school along with the teachers. \r\nThe importance of wearing masks publicly and the significance of washing hands and maintaining hygiene was reinforced in the lieu of the Corona virus pandemic.\r\n', 30, 'true', 75, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(1408, 9000, 'LCO Nasik Star Donates Medicines', 'Nashik, Maharashtra', '2020-10-10', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To provide Medical help.\r\nBeing active in various spheres the club did not leave the healthcare sector behind. Various medicines to improve the immunity of the recipients to better fight various infections were donated to Swami Shrikanthanand of Ramkrishna Arogya Sansthaan.These included Multi vitamin supplements, vitamin d tablets. Iron tablets etc. used to combat anemia and boost immunity for tribal areas in and around Trimbakeshwar.\r\n', 30, 'true', 1000, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(1409, 6000, 'LCO Nasik Star Donates Smart Phones ', 'Nashik, Maharashtra', '2020-10-10', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', '5 phones were donated to the phone library of the school (set up by the club) for the students of 10th to continue their education online, under the Loan-a-phone campaign. SIM cards with net packs were updated to make the phones fully functional for use.', 30, 'true', 5, 'DISTRICT ACTIVITIES', 'Teach Value Education', 'Teach Value Education (1 School)', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(1410, 4000, 'LCO Nasik Star Donates Story Books To Bramhanwade School', 'Nashik, Maharashtra', '2020-10-10', 'Z.C. Ln. Ritu Choudary,Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware', 'Purpose of Activity: To encourage reading habit and improve vocabulary.\r\nTo encourage & promote reading habit and improve the vocabulary of the students, over 40 books (story, literary) were donated to the library of the school of Bramhanwade set up previously by the club.\r\n', 30, 'true', 105, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
