(1531, 6400, 'Corona awareness and face mask distribution', 'Pune', '2020-10-07', '', 'Lions Club of Poona Nigdi procured 400 masks valued at Rs. 6400 and distributed those for free to the needy people near Krishna Mandir, Akurdi Railway Station, and Predeept Bharat Foundation. The members also created awareness among those people about social distancing, correct use of masks, and its benefits as protection from the Covid-19 virus. RC MJF Lion Sudam More and ZC Lion Dilipsinh Mohite, along with the President, Secretary, Jt. Secretary and other members of the club were present for this activity.', 15, 'false', 400, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Akurdi Station, Krishna Mandir, Nigdi Bus Stop', 4893941, 46113, 0, ''),
(1532, 1255, 'Donation of food grains and other eatables', 'Pune', '2020-10-14', '', 'President Lion Maruti Musmade, on behalf of the Lions Club of Poona Nigdi, donated eatables, food grains, and other household items to Ms. Mangal and her family. She works as a housemaid at some homes and is the only bread earner of her family of 11. Secretary and Jt. Secretary was present for this activity.', 2, 'false', 11, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Residence of Lion Maruti Musmade', 4893941, 46113, 0, ''),
(1533, 1200, 'Skill Development Webinar about Government Policies', 'Pune', '2020-10-17', 'RC MJF Lion Sudam More and ZC Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi, in association with Prerana Skill Development, organized a webinar about Government Policies for supporting businesses. Mr. Sadashiv Surwase (Deputy Director of Industries, Government of Maharashtra, Pune Region) was the speaker during this webinar. Past District Governor MJF Lion Omprakash Pethe inaugurated the webinar and MJF Lion Ashok Yewale was the Convenor. President Lion Maruti Musmade introduced the speaker and Secretary Lion Durga Shankar Behera and Joint Secretary Lion Rishikesh Musmade expressed the vote of thanks. ', 14, 'false', 112, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Adinath Holidays Office, Ravet', 4893941, 46113, 0, ''),
(1534, 1500, 'Donation of household items', 'Pune', '2020-10-20', '', 'First Lady Lion Shivkanya Musmade donated household items like a mixer, utensils, etc worth Rs. 1500 to Mr. Bahadur. He works as a sweeper and waste collector in the Swapnapoorti Housing Society, which is the residence of Lion Sivkanya and Lion Maruti Musmade. ', 2, 'false', 2, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Residence of Lion Maruti Musmade', 4893941, 46113, 0, ''),
(1535, 16000, 'Distribution of Measurement Units Chart', 'Pune', '2020-10-24', '', 'MJF Lion Ashok Yewale, On behalf of Lions Club of Poona Nigdi, printed 50 measurement units charts and distributed them to the quality control department of 50 industries in the MIDC region of Pimpri Chinchwad. These charts were inaugurated by Mr. Deepak Karandikar (Vice President, Maratha Chamber of Commerce). Past District Governor MJF Lion Omprakash Pethe, President, Secretary, and Jt. Secretary of LCP Nigdi was present for this activity.', 10, 'false', 600, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Exponential Industries office, MIDC Bhosari', 4893941, 46113, 0, ''),
(1536, 7500, 'Distribution of walking sticks to the blind', 'Pune', '2020-10-28', 'PDG MJF Lion Omprakash Pethe, VDG -1 MJF Lion Hemant Naik, GLT Coordinator of Multiple District 3234 MJF Lion Rajendra Mucchal, RC MJF Lion Sudam More, ZC Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi donated walking sticks to 50 needy blind people of on the occasion of the new PST\'s installation ceremony. PDG MJF Lion Omprakash Pethe, VDG -1 MJF Lion Hemant Naik, GLT Coordinator of Multiple District 3234 MJF Lion Rajendra Mucchal, RC MJF Lion Sudam More, ZC Lion Dilipsinh Mohite and many other lion members were present for this activity.', 194, 'false', 50, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Blue Water Banquets, Ravet', 4893941, 46113, 0, ''),
(1537, 75000, 'Donation for Hunger', 'Pune', '2020-10-28', 'PDG MJF Lion Omprakash Pethe, VDG -1 MJF Lion Hemant Naik, GLT Coordinator of Multiple District 3234 MJF Lion Rajendra Mucchal, RC MJF Lion Sudam More, ZC Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi donated an amount of Rs. 75,000 to the Lions District 3234 D2 for their Roti Bank Program. These funds will be utilized to feed more than 1500 people across Pune, Ahmednagar, and Nashik District. Out of these funds Region Chairperson MJF Lion Sudam More contributed Rs 50,000 and LCP Nigdi contributed Rs. 25,000. PDG MJF Lion Omprakash Pethe, VDG - 1 Lion Hemant Naik and GLT Coordinator of Multiple District 3234 MJF Lion Rajendra Mucchal, RC MJF Lion Sudam More, ZC Lion Dilipsinh Mohite, and other Lion Members were present ', 195, 'false', 1500, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. More Than 10000)', 'Blue Water Banquets, Ravet', 4893941, 46113, 0, ''),
