(1689, 0, 'Diabetes Awareness Seminar', 'Pune', '2020-10-10', '', 'Online Zoom activity for Diabetes Awareness. Our Members and their family and friends attended this online seminar. Diabetes specialist Dr. Ravindra Nandedkar, Dr Prashant Manjire had very useful information for the audience.', 150, 'false', 100, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'Online Zoom meeting', 4928820, 121506, 0, ''),
