(1692, 20000, 'eye check up camp', 'pune', '2020-10-04', 'Balajith shetty', ' eye check up activity at Shahid Bhagat Singh school at Ghorpadi. 150 speks were donated. 383 ppl were screened and 44 patients were having cataract. Local Corporator Dr. Kiran Mantri was present. All 44 cataract surgeries will be done by us at lions eye hospital.', 6, 'false', 1, 'MEDICAL ACTIVITIES', 'Free Medical Camps', 'Free Medical Camps', 'Shahid Bhagat Singh school at Ghorpadi. Pune', 973890, 50227, 0, ''),
