(1694, 200000, 'Inauguration of Lions Work for Equality Hall', 'PUNE', '2020-10-02', 'Sharad Bakare', 'On the 02nd of Oct on the occasion of Gandhi Jayanti, Lions Club of Talegaon Inaugurated its 38th Permanent project Lions Work for Equality Hall at the able hands of our respected District Governor Lion Abhay Shastri. The nature of work included building a 1200 sq.ft shed, sliding windows. furnishing, light & fan fitment, flooring, demolition of old structure, painting the whole premises. The Work for equality organisation homes about 80 homeless girls & the organisation is engaged in grooming, educating & development these girls.', 60, 'false', 1, 'PERMANENT PROJECTS', 'Any other project up to 200000 to 500000', 'Any other project up to 200000 to 500000', 'Talegaon Dabhade', 4339275, 26397, 0, ''),
(1695, 12500, 'Transperent Cover for Auto Rickshaw', 'Pune', '2020-10-04', 'Ln. Adv. Priti Paranjape', 'For keeping safe distance between Rickshaw driver and Passengers transparent curtain is provided to 25 Rickshaw drivers. this activity is done in Gokhalenagar.', 9, 'true', 25, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'Gokhalenagar', 2610567, 97073, 0, ''),
(1696, 25000, 'Distribution of Rickshaw Partition to Auto Rickshaws', 'PUNE', '2020-10-02', 'Sharad Bakare', 'On the occasion of the first day of October service week Lions Club of Talegaon distributed 100 Rickshaw partitions made mandatory by the RTO for all tourist vehicles on account of Covid-19. This activity was performed in the presence of our respected DG Lion Abhay Shastri.', 105, 'false', 2, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lions Club Talegaon Dabhade', 4339275, 26397, 0, ''),
(1697, 25000, 'Distribution of Rickshaw Partition to Auto Rickshaws', 'PUNE', '2020-10-02', 'Sharad Bakare', 'On the occasion of the first day of October service week Lions Club of Talegaon distributed 100 Rickshaw partitions made mandatory by the RTO for all tourist vehicles on account of Covid-19. This activity was performed in the presence of our respected DG Lion Abhay Shastri.', 105, 'false', 2, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lions Club Talegaon Dabhade', 4339275, 26397, 0, ''),
