(1699, 20000, 'Tree Plantation Activity at Work for Equality Home', 'PUNE', '2020-10-02', 'Sharad Bakare', 'Lions Club of Talegaon performed Vegetable garden plantation activity at the work for equality Home, In this activity we planted various vegetable plants in their premises. The plants when grown will fulfill requirement of vegetable for all the residents of the Work for Equality home permanently.', 70, 'false', 100, 'INTERNATIONAL ACTIVITIES', 'Enviornment', 'Tree plantation', 'Lions Work for Equality Organisation Talegaon Dabhade', 4339275, 26397, 0, ''),
