(1702, 2500, 'Medicinal Tree Plantation at Lions Club Ground', 'PUNE', '2020-10-02', 'Sharad Bakare', 'Lions Club of Talegaon  performed Medicinal trees  plantation at Lions club ground. We planted about 25 different medicinal plants in the clubs premises & also installed plates naming the plant & the medicinal benefits of these plants. The plants when fully grown will be helpful for the whole colony.', 35, 'false', 25, 'INTERNATIONAL ACTIVITIES', 'Enviornment', 'Tree plantation', 'Lions Club Talegaon Dabhade', 4339275, 26397, 0, ''),
(1703, 4500, ' Sweets, Vitamin C & Arsenic Album tablets Distribution to Children of Work for equality home', 'PUNE', '2020-10-02', 'Sharad Bakare', 'Lions club of Talegaon distributed Sweets, Arsenic Album Tablets & Vit C tablet to the children of Lions Work for equality home. These tablet will help to boost immunity of the children & protect them against any infection specifically COVID-19.', 20, 'false', 1, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lions Work for Equality Organisation Talegaon Dabhade', 4339275, 26397, 0, ''),
