(1706, 750, ' Distribution of Vaporisers to children of Lions work for equality Home', 'PUNE', '2020-10-02', 'Sharad Bakare', 'Lions Club of Talegaon Distributed Vaporisers to the children of Work for Equality home. During this time of Covid-19 it was advised inhale steam for protection against throat infections & spreading of Corona Virus. The Vaporizers helped the children to prevent the spread of disease.', 20, 'false', 1, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Lions Work for Equality Organisation Talegaon Dabhade', 4339275, 26397, 0, ''),
(1707, 1050, 'Distribution of Nutritious food to Malnourished Children at the hands of DG Lion Abhay Shastri', 'PUNE', '2020-10-02', 'Sharad Bakare', 'Lions Club of Talegaon distributed Nutritious food packet consisting of Almonds, Rajgira ladoo, Peanut Chikki, Protein Powder & Dates to 3 Malnourished Children. The items will last them for 60 days & will provide the children with nutrients essential for their all-round growth & development.', 10, 'false', 1, 'MEDICAL ACTIVITIES', 'Eradication of Malnutrition', 'Eradication of Malnutrition', 'Induri Village ', 4339275, 26397, 0, ''),
(1708, 1260, 'Distribution of Lions Masks to Auto Rickshaw Drivers', 'PUNE', '2020-10-02', 'Sharad Bakare', 'Lions Club of Talegaon Distributed Lions masks to Rickshaw drivers. These masks will provide them safety against Covid infections.', 20, 'false', 1, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Talegaon Dabhade', 4339275, 26397, 0, ''),
