(1710, 2500, 'CQI  Member Orientation Programme', 'Nashik', '2020-10-07', 'Lion VDG II Rajesh Kothavade, Lion, Pravin Jaykrishniya, Lion Abhay Choksi, ', 'A joint seminar of the zone 3 e was arranged by zone chairperson at Lions Club banquet hall Pandit Å• Nashik VDG II  Ln Rajesh ji kothawade took a very nice orientation which was new for senior members also. Dist Chairperson Ln Abhay Shastri took a nice n informative seminar on CQI', 75, 'true', 25, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Lions hall, New Pandit colony', 4400085, 125338, 0, ''),
(1711, 29500, 'Eye Check up camp & Spectacle Distribution  ', 'Nashik', '2020-10-05', 'ln. Vilasrao Patil, Ln. Chandrashekhar Sonawane, Ln. Jayom Vyas, ln. Sunil Nikumbh, VDG II Rajesh Kothawade', 'An EYE check up camp was organised in Anjaneri village.@250 villerges were checked & 145 persons were provided with spectacles as per need.20 persons have been shortlisted for cataract surgery.\r\nActivity chairperson lion Vilasrao Patil did very nice and well-organized activity, which went on between 9 a.m. and 1 p.m.', 48, 'true', 250, 'INTERNATIONAL ACTIVITIES', 'Vision', 'Eye screening camps', 'Anjeneri, Trambak, Nashik', 4400085, 125338, 0, ''),
(1712, 750, ' Vapouriser Distribution to members of Vanprasth Vruddh Ashram', 'PUNE', '2020-10-03', 'Sharad Bakare', 'Lions Club of Talegaon Distributed Vaporisers to the members of Vanprasth Vruddh Aashram. During this time of Covid-19 it was advised inhale steam for protection against throat infections & spreading of Corona Virus. The Vaporisers helped them to prevent the spread of disease.', 6, 'false', 1, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Vanprastha Vrudha Ashram Talegaon Dabhade', 4339275, 26397, 0, ''),
(1713, 2900, 'Blood Donation Camp at Lions Vivekand Hall', 'PUNE', '2020-10-04', 'Sharad Bakare', 'Lions Club of Talegaon organised a blood donation camp in association with Poona Serological Institutes Atharva Blood bank.  There is acute shortage of blood in the blood banks & people are not ready to donate blood during the Covid-19 times & this donation will help save several lives. We collected 25 units of blood on that day.', 80, 'false', 25, 'MEDICAL ACTIVITIES', 'Blood Donation', 'Blood Donation', 'Lions Vivekand Hall Talegaon Dabhade', 4339275, 26397, 0, ''),
(1714, 4500, 'Food Donation to Swaraj Nagari Slum Area', 'PUNE', '2020-10-04', 'Sharad Bakare', 'Lions Club of Talegaon Distributed tasty & Wholesome food packets to the dwellers of the Swaraj Nagari Slum area. Due to Covid-19 there were job loss for the daily wage workers & construction workers, These slum dwellers had not eaten well for nearly 3 months. When they were given properly cooked tasty & wholesome food they were extremely contented & happy. The Joy on their face was priceless.', 14, 'false', 50, 'INTERNATIONAL ACTIVITIES', 'Hunger ', 'Providing food to needy', 'Swaraj Nagri Talegaon Dabhade ', 4339275, 26397, 0, ''),
(1715, 5700, 'Anajdhan to Vanvasi Vidyarthi Vasati gruh Vadgaon', 'PUNE', '2020-10-05', 'Sharad Bakare', 'Lions Club of Talegaon Distributed Grocery to the Vanprasth Vidyarthi Vasati Gruha. Due to Covid-19 there were not many donations to the Aashrams, The Ashram Children were happy to receive the donation as they would be able to get proper meals.', 6, 'false', 5700, 'INTERNATIONAL ACTIVITIES', 'Hunger ', 'Food grains donation / anaj dan', ' Vanvasi Vidyarthi Vasati gruh Vadgaon Maval', 4339275, 26397, 0, ''),
(1716, 750, 'Vapouriser Distribution to Vanvasi Vidyarthi Vasati gruh Vadgaon', 'PUNE', '2020-10-05', 'Sharad Bakare', 'Lions Club of Talegaon Distributed Vaporisers to the members of Vanvasi Vidyarthi Vasati gruh Vadgaon. During this time of Covid-19 it was advised inhale steam for protection against throat infections & spreading of Corona Virus. The Vaporisers helped them to prevent the spread of disease.', 6, 'false', 1, 'DISTRICT ACTIVITIES', 'I am Corona Warrior', 'I am Corona Warrior (Exp. Less Than 10000)', 'Vanvasi Vidyarthi Vasati gruh Vadgaon Maval', 4339275, 26397, 0, ''),
