(2051, 7500, 'LCO Nasik Star Distributed Diwali Faral', 'NASIK', '2020-11-07', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware, VDGII Ln. Rajeshji Kothawade', 'Purpose of Activity: To Celebrate Diwali with Bramhanwade School Students.\r\nBiggest festivalâ€¦...Diwali was on the peak and so LCO Nasik Star Celebrated by Distributing Diwali faral to Bramhanwade school students and teachers. Which gave lots of pleasure, cheerfulness and fulfillment.\r\nThere were packets containing CHIWADA, CHAKALI, and LADDU.Students were very happy while receiving it. It was rural urban integration as kids from lion family shared these packets with their friends.\r\n\r\n', 40, 'true', 110, 'EVENT CELEBRATION', 'Others', 'Others', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(2052, 34000, 'Anaj Daan Activity', 'sagmner', '2020-11-08', '', 'Distribution of Diwali Faral 430 packets at satyaniketan ashramshala, Shenit by our club members represented Lion Ashok Mistry', 4, 'false', 430, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'shenit,', 4798214, 57277, 0, ''),
(2053, 15000, 'Anaj Daan Activity', 'pune', '2020-11-05', '', 'food grains at sanskar pratishtan school by Ln Satish Karanjkar- Brinton Carpets', 2, 'false', 90, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'pune', 4798214, 57277, 0, ''),
(2054, 3500, 'LCO Nasik star Conducted Killa Making compitition & Prize Distribution', 'NASHIK', '2020-11-07', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware , VDGIILn. Rajeshji Kothawade', 'Purpose of Activity: To develop the skill of art of the students.\r\nTo enhance the skill of art we decided to ask the students for making killas.\r\nOn that note teachers made 7 group of 6 students in each. Students started working on that.  Magnificent, attractive Killas made by Bramhanwade school students. Hat off to the studentâ€™s efforts to whom having less sourcesâ€¦. staying in villageâ€¦. resulted wonderfully in the work given to them. Judging was the most difficult part. Club Given this responsibility to guest VDG II Ln. Rajeshji Kothawade and own club member Ln. Dr.Amit Prabhu .At the time of judging head of the group explained detail of killas which really impressed to judges. Judges did their job perfectly and declared 1st and 2nd winner. Those prizes were sponsored by club member Ln. Santosh Kalantri.\r\n\r\n', 40, 'true', 25, 'EVENT CELEBRATION', 'Others', 'Others', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(2055, 5200, 'LCO Nasik Star Conducted Lantern Making Compitition & Prize Distribution', 'NASHIK', '2020-11-07', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware, VDGII Ln. Rajeshji Kothawade', 'Purpose of Activity: To develop the skill of art of the students.\r\nDiwali festive season = Laltern is equation. Keeping this in front. We arranged Laltern making competition for Bramhanwade School students. Material required for making Laltern was provided by club member Ln. Abhay and Ashwini Bag. Beautiful, Creative Laltern were made by students. For Judging club given responsibility to Ln. Meera Marathe, Ln. Abhay Bag, Ln. Sarika Kalantri and Sanchita Kulkarni. They selected three prizes and four consolation.\r\n', 40, 'true', 43, 'EVENT CELEBRATION', 'Others', 'Others', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(2058, 20000, 'LCO Nasik Star Donated Cycles To New English School Wavi-harsh', 'NASHIK', '2020-11-07', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware, VDGII Ln. Rajeshji Kothawade', 'Purpose of Activity: To bridge the gap between children and their schools.  \r\nLions club of Nasik star conducted yet another mega activity of donating 10 cycles at New English school Waviharsh to bridge the gap between children and their schools. These were distributed as a part of the cycle bank set up at New English school Waviharsh where in students shall return these cycles to the school once they pass out to benefit other students. Donated by the club.\r\n', 40, 'true', 10, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'Waviharsh ', 4520195, 97806, 0, ''),
(2059, 43000, 'LCO Nasik Star Donated Cycles at Bramhanwade School', 'NASHIK', '2020-11-07', 'Mjf Ln. Nitin Marathe,Mjf Ln. Ram Daware, VDGII Ln. Rajeshji Kothawade', 'Purpose of Activity: To bridge the gap between children and their schools.  \r\nLions club of Nasik star conducted yet another mega activity of donating 18 cycles at Madhyamik vidyamandir Brahmanwade to bridge the gap between children and their schools. These were distributed as a part of the cycle bank set up at Madhyamik vidyamandir Brahmanwade where in students shall return these cycles to the school once they pass out to benefit other students. Donated by the club.\r\n', 40, 'true', 18, 'OTHER IMPORTANT', 'Youth Development', 'Youth Development', 'Brahmanwade ,Trimbkeshwar', 4520195, 97806, 0, ''),
(2060, 18000, 'DONATION AND ANAAJDAN', 'PUNE', '2020-11-07', ' RC LN RAVI GOLAR AND LN RAMPRASAD MURTHY', 'Donation of Rs. 15000/- for Purchase Diwali Dresses 15 girls of Sarvesham Seva Sangh and Rs. 3000 for Anaajdan to Sarvesham Seva Sangh', 16, 'false', 15, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Office No 103, 1st Floor, MPJ Chambers, Navasphurti Co-operative Society Ltd.  Above \"The Raymond Shop\" & \"Bombay Dyeing\" ,Near \"The Vodafone Store\",  Old Pune Mumbai Highway,  Wakadewadi, Pune 411003.', 3426478, 103912, 0, ''),
