(2062, 2000, 'Nirmalya & Ganesh Idols Collection', 'Sangamner', '2020-09-01', '', 'On the occasion of Ganesh Visarjan every year club collects Ganesh puja nirmalya & Ganesh Idols to avoid river water pollution. This time club arranged camp @ Ganesh Garden, Ganeshnagar for collection of nirmalya & Ganesh idols .We collects about 2 tons of nirmalya & 890 ganesh idols from urban area of Ganeshnagar. This activity was conducted with the association of Sangamner Municipal Council.For this noble activity Dy collector of Sangamner Sub division Mr Dr Shashikant Mangrule feliciteted the club with momento (Sanman chhinha)', 200, 'true', 1, 'DISTRICT ACTIVITIES', 'Swachchha Nadiya', 'Swachchha Nadiya', 'Ganesh Garden Ganesh Nagar ,Sangamner', 3325705, 35107, 0, ''),
(2063, 3000, 'Providing Diwali sweets to Trible school ( Joint club activity with supreme)', 'Sangamner', '2020-11-07', 'Nitin Vasant Belsare', 'Providing Diwali Pharal & sweets to Tribles students from Dr Rajendra Prasad  school @ Shenit , Akole, Near Sangamner ', 75, 'true', 470, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Dr Rajendra Prasad School , Shenit , Akole Sangamner , MH', 5283235, 140549, 0, ''),
(2064, 22265, 'Campaign@365 - A Fund Rasising Activity', 'Pune', '2020-11-15', 'Dr Mrunal Belsare', 'Campaign@365 : A funds Raising Activity .After lots of Brain storming our club has come up with unique idea of fund raising through family and friends even general public. We have given name as Campaign-365 to this activity. Basically its all about contributing Rs 1 per day by a contributor and hence Rs 365 per Annum. In case if family has three members then its 3 x 365 = Rs 1095/ family. Broucher is prepared and distributed in hard and soft form.', 68, 'false', 61, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Pune', 5283235, 140549, 0, ''),
(2065, 0, 'GB Meeting  with fun and Refreshment ', 'Pune', '2020-11-22', 'Dr Mrunal Belsare', 'GB meeting was conucted at Hotel Multispice fallowed by Diwali lunch party . All members came together almost after 7-8 months due to panedmic situatation. Apart from sharing of business related to lions club . CQI initiative of introduce your self to all was also conducted. This has inducted almost 16Nos of new members contributing to 80% growth to club membership. They understood lionism and club team in better way. This is the best retension activity we have carried out.', 101, 'false', 29, 'EVENT CELEBRATION', 'Others', 'Others', 'Multi Spice Hotel , Near DP road , Karve nagar', 5283235, 140549, 0, ''),
(2066, 6000, 'Awarness of corona', 'Nashik', '2020-10-03', 'President ln. P G patil, RC Rajendra pagar, ln. Satis Kothari , Ln. J P Jadhav,  Ln. C. R. Avhad', 'dated 3rd October 2020. evening 5:00 p.m. the 10,00w0 handbills of Kabardari are distributed to the joggers at the Golf Club jogging track and surrounding area of Gorakhpur UP in this cover the Re brochure the information of taking care in the period of Corona covid-19 is printed these ten thousands and bills are distributed home to home planning through the newspaper and by hands also at Canada Corner bus station Raninagar City Centre Mall Gangapur Road Savarkar Nagar CIDCO for this activities PST RC lion RD pagaar lion BB Patil lion Vishnu Kant', 44, 'true', 10000, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'Golf club ground, Nashik ', 3240866, 68476, 0, ''),
(2067, 15000, 'Distribution of Sweets n Snacks', 'SINNAR', '2020-11-16', 'Ln Hemant Waje, Ln Vijay Loharkar, Ln Manish Gujarati', 'On the Eve of Diwali around 250 under privilege families were distributed with sweets and snacks at the near by village Pangerwadi and Chandrapur , the village which have been adapted by our club ', 48, 'true', 250, 'DISTRICT ACTIVITIES', 'Others', 'Others', ' Village Pangerwadi and Chandtapur', 4403075, 61500, 0, ''),
