(2069, 20000, 'Distribution of Divali Faral (Sweets)packets', 'Sangamner', '2020-11-11', '', 'On the occasion of Divali festivals Club distributed faral packets that includes Karanji ,Ladu,Shankarpali,farsan,Chakali,shev, sonpapadi. At akole road near Mhalungi river about 100 poor families are residing as slum in Zopadpatti.We take opportunity to sweeten their divali festivals with distribution of divali faral. Social worker Mahesh Mayur,Local Social activist Madhav Bharitkar, Club officers Ln Prakash Kalantri, Ln Vilas Kshatriya,Ln Shrinivas Pagdal,Ln Sanjay Asawa,Ln Rajesh Lahoti Ln Nandkishor Belhekar Ln Sunita Pagdal ,Ln Rakhi Karwa were attended the program ', 8, 'true', 100, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Govindbaba mandir,Bharitkar mala,Akole road,Sangamner', 3325705, 35107, 0, ''),
