(2073, 200, 'collection of old used spect', 'Nashik', '2020-11-05', 'President ln. P. G. Patil, on. Satis Kothari, ln. Savkar, mjf on. R. D. Pagar, on. J. P. Jadhav, ln. N. D. Pawar,  ln. P. T. Ahirrao', 'for collection of old used spect in good condition to be collected in a two box kept at Madhav sweet and Ganesh medical store Sawarkar Nagar Nashik received very good response for this activity. PST cabinet officer, N.D. Pawar, P T Ahirrao,  RC Rajendra pagaar lion Vishnukant  Gite. past president lion BB Patil, Ln. pokharkar are present.', 30, 'true', 200, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'Savarkar nagar ', 3240866, 68476, 0, ''),
