(2075, 5000, 'Anajdan', 'Pune', '2020-11-08', 'Ln Seema Dabke (DC Peace Poster Contest) Ln Pradeep Thakar', 'On 8th Nov 2020 Lions Club of Poona West along with Suryadutta Institute have distributed food grains to Om Sai Om Handicapped School. At the same time masks were also distributed to the handicapped students.  founder of Suryadatta Mr. Sanjay Chordia were present as Cheif Guests. President of Poona West Ln Pallavi, Ln Seema, Ln Deepali, Ln Pradeep and Ln Ketki were present for the activity.', 10, 'true', 15, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Bavadhan', 4653193, 53804, 0, ''),
(2076, 9000, 'Past Presidents felicitation and Region Chairperson MJF Ln Rajendra Pagar\'s visit', 'Nashik', '2020-11-27', 'President ln. P G patil,  ln. Satis Kothari , Ln. J P Jadhav,  Ln. C. R. Avhad ln. Savkar', 'Lions club of Nashik supreme has organised Past Presidents felicitation and Region Chairperson MJF Ln Rajendra Pagar\'s visit on 27th November 20 at Clubs General body meeting. The function was organised at 7.30 pm at Lions hall Pandit colony Nashik. It was graceful function . All the past Presidents were felicitated with beautiful  gifts. The RC appreciated clubs activities during the Corona pandemic. \r\nThe District awards of LY 2019-20 of DG Ln Omprakash Pethe were handed over to-\r\n1) Diamond Trophy to CP & cabinet officer MJF Ln J P Jadhav \r\n2) Diamond Trophy to President (2019-20) Ln N D Pawar \r\n3) Golden Trophy to ZC ( 2019-20) to MJF Ln Rajendra Pagar. \r\nThe meeting was followed by fellowship and dinner.', 90, 'true', 25, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Lions Club Hall new Pandit colony Sharanpur Road Nashik ', 3240866, 68476, 0, ''),
