(2099, 2000, 'Blood Donation Camp in Pradhikaran', 'Pune', '2020-11-06', 'RC MJF Lion Sudam More and ZC MJF Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi, in association with Lions Club International District 3234D2 and Gholab Blood Bank, organized a blood donation camp at Sambhaji Chowk, Pradhikaran. A mobile vehicle to collect blood was sent bt District 3234D2, through which a donation of 20 bottles (6 liters) of blood was received. Regional Chairperson MJF Lion Sudam More, Zone Chairperson MJF Lion Dilipsinh Mohite, PST, and other members of the club were present for this activity.', 36, 'false', 20, 'MEDICAL ACTIVITIES', 'Blood Donation', 'Blood Donation', 'Sambhaji Chowk, Pradhikaran', 4893941, 46113, 0, ''),
