(2111, 8000, 'Distribution of face masks and Diwali hampers', 'Pune', '2020-11-11', 'RC MJF Lion Sudam More and ZC MJF Lion Dilipsinh Mohite', 'Members of Lions Club of Poona Nigdi bought and distributed 100 face masks and Diwali hampers with some items of Abhyanga Snaan worth Rs. 8000/- to State Transport workers at Vallabhnagar Bus Depot. The Regional Officer of State Transport Department of Pune region, Mr. Ramakant Gaikwad were the chief guest of this event. These masks were bought from Mitra Rehabilitation Centre, Anand Gujarat, which works for the welfare and education of specially-abled students of the region. Therefore the amount received from LCP Nigdi would be utilized for their education and other purposes. Regional Chairperson MJF Lion Sudam More, Zone Chairperson MJF Lion Dilipsinh Mohite, President, Secretary, Treasurer, and other Lion members were present for this activity.', 30, 'true', 100, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'Vallabhnagar Bus Depot, Pune', 4893941, 46113, 0, ''),
