(2113, 1200, 'Skill Development Webinar on Business Accounting', 'Pune', '2020-11-21', 'RC MJF Lion Sudam More', 'Lions Club of Poona Nigdi, in association with Prerana Skill Development, organized a webinar about Business Accounting. Lion CA Vishnudas Bangad was the speaker during this webinar, which was attended by more than 35 students and business persons. Multiple Council Chairperson MJF Lion Girish Malpani inaugurated the webinar. Past District Governor MJF Lion Omprakash Pethe and MJF Lion Ashok Yewale was the Convenor. VDG2 Lion Rajesh Kothawade. President Lion Maruti Musmade and Secretary Lion Durga Shankar Behera attended this webinar. Joint Secretary Lion Rishikesh Musmade expressed the vote of thanks.', 5, 'false', 40, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Zoom Video Call', 4893941, 46113, 0, ''),
