(2115, 10000, 'Donation for Education of Underprivilaged', 'Pune', '2020-11-27', 'RC MJF Lion Sudam More and ZC MJF Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi donated an amount of Rs. 10,000/- for the educational expenses of Hitesh Gaikwad, an underprivileged student studying in 10th grade. His mother works as a housemaid at the residence of club Secretary Lion Durga Shankar Behera. Regional Chairperson MJF Lion Sudam More, Zone Chairperson MJF Lion Dilipsinh Mohite, PST, and other Lion Members were present for this activity, which took place alongside the Zone Chairperson Visit of the Club', 120, 'false', 1, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Hari Constructions Office', 4893941, 46113, 0, ''),
(2116, 5000, 'Donation for Treatment of Cancer', 'Pune', '2020-11-27', 'RC MJF Lion Sudam More and ZC MJF Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi donated an amount of Rs. 5,000/- for the treatment of Mrs. Shanta Badhe, a patient suffering from Cancer. This amount was donated through the gracious hands of GLT Coordinator Lion Ravindra Satpute. Regional Chairperson MJF Lion Sudam More, Zone Chairperson MJF Lion Dilipsinh Mohite, PST, and other Lion Members were present for this activity, which took place alongside the Zone Chairperson Visit of the Club', 120, 'false', 1, 'MEDICAL ACTIVITIES', 'Others', 'Others', 'Hari Constructions Office', 4893941, 46113, 0, ''),
