(2829, 12000, 'Supporting to Child cancer patients', 'Pune', '2020-12-21', 'Dr Mrunal Belsare', 'Our club has participated in Joint club activity under Zone 1 of region Brahmaputra district 3234 D2. We jointly donated 20Nos of blankets to 20Nos of Children suffering from cancer. This is done by our ZC Ln Vijayji Rathi to our DG MJF Ln Abhayji Shastri sir.', 24, 'false', 1, 'INTERNATIONAL ACTIVITIES', 'Childhood Cancer', 'Awareness Drive', 'District Office , Pune', 5283235, 140549, 0, ''),
(2830, 1000, 'District Award Ceroemony Winning Club', 'Pune', '2020-11-08', '', 'On Sunday,  08  November 2020, 09 am to 3 pm , total 6 hours. District Award ceremony our club wins 3 Award in Various Categories.\r\n1) Best President Platinum Award â€“ Ln. Kalpana Vilas Manjare\r\n2) Best Secretary Award â€“ Ln. Jyoti Hanumant Kad\r\n3) Best Cabinet Officer Oward â€“ Ln Prakash Mutke\r\n There were 04 Lions Members Presented. \r\nSponsored by Lions club Chakan. Total Expenses Were Rs.1000/-.  PST LIONS CLUB CHAKAN (2020-2021)\r\n', 6, 'false', 200, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'marigold hotel baudan pune.', 4744716, 50598, 0, ''),
