(2832, 1000, 'Lions seva naykon ka sanman', 'CHAKAN', '2020-11-30', 'Ln. Balasaheb Mutke', 'Lions seva naykon ka sanman Participated by 3 members. Ln. Kalpana Manjare - IPP, Ln. Vilas Manjare , Ln. Sunil Pathare â€“ vice Secretary, making video of all President of Lions club Chakan since 1990 to 2020. 30 years Celebrated lions club Chakan. And this Video Submitted to District Secretary  Ln. Parmanand Sharma and Ln. Santosh Sonawale.\r\nThanks for video Making by Ln. Sunil Pathare.\r\nSponsored by Ln Sunil Pathare. Total Expenses Were Rs.1000/-.  PST LIONS CLUB CHAKAN (2020-2021)\r\n\r\n\r\n', 1, 'false', 3, 'OTHER IMPORTANT', 'Lions Quest', 'Lions Quest', 'Ln. Dr. V. G. Joshi Eye Hospital, Chakan.', 4744716, 50598, 0, ''),
(2833, 650, 'Tree Plantation', 'CHAKAN', '2020-12-30', 'Ln. Balasaheb Mutke', 'On Tuesday,  30  December 2020, 12 pm to 3 pm , total 3 hours,  Sow Service Seeds Through LCC taken Tree Plantation at  Ln. Dr. V. G. Joshi Eye Hospital, Chakan . therewere take cared of tree and give it the fertilizers. There were 2 Lions Members Presented.  Sponsored by President Ln. Balasaheb Mutke. Total Expenses Were Rs.650/-.  PST LIONS CLUB CHAKAN (2020-2021)', 3, 'false', 10, 'INTERNATIONAL ACTIVITIES', 'Enviornment', 'Tree plantation', 'Ln. Dr. V. G. Joshi Eye Hospital, Chakan.', 4744716, 50598, 0, '');
