(2841, 108000, 'Low rate Eye Check up & Cataract operation', 'CHAKAN', '2020-12-31', 'Ln. Balasaheb Mutke', 'On Thursday,  31  December 2020, 12 pm to 3 pm , total 30 Days , 90  hours (in all December months)  Sow Service Seeds Through LCC taken Low rate Eye Check up & Cataract operation at  Ln. Dr. V. G. Joshi Eye Hospital, Chakan . There were 50 Lions Members Presented in all December months. LCC did Eye check up for 120 patient of low rate Rs. 100 each . Total Exp. Rs.12000/-.Therewere they did cataract Operation for 12 patient of low rate Rs. 8000 Each. Total exp. Rs.96000/- (in Rs. 8000 each including Operation Materials Cost. Such as Surgeon Dr Fee, Lens, Medicines and etc Exp.).  Sponsored by President Lions Club Chakan. Total Expenses Were Rs.108000/-.  PST LIONS CLUB CHAKAN (2020-2021)', 3, 'false', 132, 'INTERNATIONAL ACTIVITIES', 'Vision', 'Eye screening camps', 'Ln. Dr. V. G. Joshi Eye Hospital, Chakan.', 4744716, 50598, 0, ''),
(2842, 2500, 'Afforestation', 'Pune', '2020-12-27', 'ashish majumdar', 'Today Lions Club of Poona Pimpri Chinchwad and Lions Club of Poona Shatabdi jointly in association with Punjabi Cultural Association( PCA) conducted tree plantation activity on piece of land provided by PCA. The activity was attended by PDG Raj Bhai Muchal as Chief guest. The attendance also included PDG Damleji and both ZC Lion Ashish Majumdar & Lion Sandeep Malik. The activity was also attended by DC Tree plantation Lion Raghunath Dhole and Members of both the Clubs. Our Club was represented by Lion Kashmir Nagpal, Lion Ashish Majumdar, Lion Murraza, Lion Bobby Main, Lion Narwani, Lion Abhijit & Lion Madhuri Deshpande. We are thankful to PCA Chairman Lion Kashmir Nagpal & his Board of Trustees for their help & support in this activity.', 10, 'false', 100, 'DISTRICT ACTIVITIES', 'Afforestation', 'Afforestation', 'Punjabi Culture Association ', 3812664, 37292, 0, ''),
(2843, 2500, 'Afforestation', 'Pune', '2020-12-27', 'ashish majumdar', 'Today Lions Club of Poona Pimpri Chinchwad and Lions Club of Poona Shatabdi jointly in association with Punjabi Cultural Association( PCA) conducted tree plantation activity on piece of land provided by PCA. The activity was attended by PDG Raj Bhai Muchal as Chief guest. The attendance also included PDG Damleji and both ZC Lion Ashish Majumdar & Lion Sandeep Malik. The activity was also attended by DC Tree plantation Lion Raghunath Dhole and Members of both the Clubs. Our Club was represented by Lion Kashmir Nagpal, Lion Ashish Majumdar, Lion Murraza, Lion Bobby Main, Lion Narwani, Lion Abhijit & Lion Madhuri Deshpande. We are thankful to PCA Chairman Lion Kashmir Nagpal & his Board of Trustees for their help & support in this activity.', 10, 'false', 100, 'DISTRICT ACTIVITIES', 'Afforestation', 'Afforestation', 'Punjabi Culture Association ', 3812664, 37292, 0, ''),
