(2951, 20000, 'Installation of animal feeder', 'Lonavla', '2020-12-17', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers.... *LCO Lonavala Supremos* Jointly With *Lonavala Municipal Council & Society For Animal Safety-India (SAS)* Installed *Feeders For Food & Water At Diffrent Points In Lonavala Khandala On 17th Dec..* Present For This *Activity* Were *President SAS Nitesh Khare Sir Bollywood Actress & V.President SAS Ayesh Jhulka Ma\'am.. President LMC Surekha Jadhav Madam..Shri Shreedhar Poojari (Ex V.President LMC)..Chief Officer LMC Shri Ravi Pawar Sir & Other Corporators Of LMC.*\nA Unique *Activity* Taken At Hand By *Team Lonavala Supremos + Leo Lonavala Supremos* Jointly With *SAS & LMC Under The Swach Sarvekshan 2021 Programme.*', 20, 'yes', 100, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'LMC area', 5099270, 122786, 0, ''),
(2952, 5000, 'Playcard making for swach sarvekshan for LMC', 'Lonavla', '2020-12-19', 'Ameen Wadiwala', 'Respected Supremo Members & Well Wishers Our *3 Active Members & Artists Ln Prathmesh Gurav..Ln Dr Aaliya Sayyad & Ln Javid Sayyad* Started The *Activity Of Making Placards For A Function To Be Held On 19th Dec In Regards To Animal Cruelty & Caretaking Of Animals In & Around Lonavala Khandala..* This Prgrm was Decided To Be Conducted Jointly With Lonavala Municipal Council & NGO SAS With The Help & Co operation Of *LCO Lonavala Supremos + Leo Club Of Lonavala Supremos.*\nðŸ‘† Above Are Some Of The Placards Being Made Ready By Team Lonavala Supremos.', 50, 'yes', 100, 'OTHER IMPORTANT', 'Peace Poster', 'Peace Poster', 'Lonavla', 5099270, 122786, 0, ''),
(2953, 2000, 'Meeting with Ayesha Zhulka ', 'Lonavla', '2020-11-29', 'Suraiya Wadiwala', 'Respected Supremo Members & Well Wishers.... *LCO Lonavala Supremos* Were *Invited* By *Bollywood Superstar Actress Ayesha Jhulka Ma\'am* For A Meeting To Join Her *NGO Society For Animal Safety-India (SAS) Looking At The Exampalary Work In Animal Care & Feeding Of Lonavala Supremos* On 29th Nov 2020..This Meeting was attended By Myself *Ln Ameen Wadiwala..Club President Ln Suraiya Wadiwala..Club Treasurer Ln Apoorva Lohar..Ln Prathmesh Gurav..Ln Sachin Kute..Ln Girish Ji Parakh & Ln Sayyad Javid Kalim..* It was a succesful Meeting Where LCO Lonavala Supremos Decided To *Join Ayesha Jhulka Ma\'am & Her NGO SAS* For The *Good Work Towards The Animals.*', 15, 'no', 50, 'OTHER IMPORTANT', 'Art & Culture', 'Art & Culture', 'Karla', 5099270, 122786, 0, ''),
