(3017, 1700, 'Free health check-up camp', 'CHAKAN', '2021-01-10', 'LCC PRESIDENT OF LN BALASAHEB MUTKE', 'On Sunday,  10 January 2021, 10 am to 5 pm , Total 7  hours,   Sow Service Seeds Through LCC taken Free health check-up camp  at Khushal Swranali 2 , Sahkari Gruhrachana Society, Kharabwadi,Chakan..  There were 10 Lions Members Presented.  Lions Club Chakan And Khushal Swranali 2 , Sahkari Gruhrachana Society, Kharabwadi, Chakan  together get this camp.\r\nIn this Camp did Free health check up mentioned as below.\r\n1) diabetes checked by Ln. Dr. Prashant Shelar (Daibetes Specialist), \r\n2) Blood Pressure & Weight Checked by Ln. Dr. Vilas Manjare  LCC (Shodh Lab) & & Ln. Dr. Pachakshri Pujari.\r\n3) Eye Regarding Free Guildance and Eyc Cheked up by Ln. Dr. Chandrashekhar valhavankar (Eye Specialist) \r\nTotal 132 patient check up in this Camp. \r\nSponsored by Khushal Swranali 2 , Sahkari Gruhrachana Society, Kharabwadi,Chakan. Total Expenses Were Rs.1700/-.  PST LIONS CLUB CHAKAN (2020-2021)\r\n', 7, 'false', 132, 'INTERNATIONAL ACTIVITIES', 'Diabetes', 'Screening camps', 'PRESIDENT Ln.  Balasaheb Mutke Homes, MUTKEWADI,Chakan.', 4744716, 50598, 0, ''),
