(3086, 10724, 'Donation of Blankets', 'Pune', '2021-01-03', 'RC MJF Lion Sudam More, ZC MJF Lion Dilipsinh Mohite', 'Lions Club of Poona Nigdi donated 12 blankets, 12 gowns and 12 adult diapers to the women of Anandghan Old Age Home at Triveninagar, Chinchwad. Region Chairperson MJF Lion Sudam More, Zone Chairperson MJF Lion Dilipsinh Mohite, Mrs. Mangala Kadam (Former Mayor PCMC), PST and other Lion members were present for the same.', 20, 'false', 12, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Triveninagar, Chinchwad', 4893941, 46113, 0, ''),
(3087, 5000, 'Tree Plantation (Devrai) at Yerwada', 'Pune', '2021-01-27', '', 'Lions Club of Poona Nigdi participated in a Tree plantation activity, conducted by the District, including Zone 1,2 and 3 at \'Shaskiya Bahu-uddeshiya Divyanga Sammishra Kendra, Yerwada\' in association with The Government of Maharashtra. A total of 400 ayurvedic and mecicinal tree saplings were plantedon this occassion. District Governor MJF Lion CA Abhay Shastri, Deputy Commissioner of Social Welfare (Government of Maharastra), Mr. Shelke and Social Welfare officer Mr. Pravin Korgontivar, VDG 1 MJF Lion Hemant Naik, GAT Co-ordinator Lion Vijay Sarda, District \'Devrai\' chairperson Lion Raghunath Dhole, Principal Mrs. Wagh, RC MJF Lion Sudam More, RC Lion Manoj Balgat, RC Lion Murlidhar Sathe, ZC MJF Lion Dilipsinh Mohite, ZC Lion Deepa Jadhav, PST of LCP Nigdi and other Kions were present for the same', 25, 'true', 400, 'DISTRICT ACTIVITIES', 'Afforestation', 'Afforestation', 'Yerwada', 4893941, 46113, 0, ''),
