(3149, 1200, 'Skill Development Webinar', 'Pune', '2021-01-30', 'RC MJF Lion Sudam More, ZC MJF Lion Dilipsinh Mohite', 'Prerana Skill Development, in association with Lions Club of Poona Nigdi, Lions Club of Pune Akurdi, Lions Club of Pune Phoenix, Lions Club of Pune 21st Century, organized a webinar on Successful Business. District Governor MJF Lion CA Abhay Shastri inaugurated the webinar, Mr. Jaydeep Desai was the speaker and Skill Development District Chairperson MJF Lion Ashok Yewale was the convenor. Immediate PDG MJF Lion Omprakash Pethe summarized the webinar and the vote of thanks was given by Lion Makrand Shaligram. RC MJF Lion Sudam More, ZC MJF LIon Dilipsinh Mohite, PST, other members of the club and 55 other participants attended the webinar.', 7, 'false', 55, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Online webinar Zoom', 4893941, 46113, 0, ''),
(3150, 1500, 'Donation of Clothes', 'Pune', '2021-01-26', '', 'Lion Geeta Behera donated sarees worth Rs. 1500/- to a needy woman working as a house maid, on behalf of LCP Nigdi.', 6, 'false', 1, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Swapnapoorti Phase - 1 Hsg. Society', 4893941, 46113, 0, ''),
(3151, 1981, 'Donation of Eatables and Other Items', 'Pune', '2021-01-31', '', 'Lion Shivkanya Musmade, donated foodgrains, other eatables, and household items to Mrs. Rasanbahire. She works as a housemaid at the residence of Lion Musmade and is the sole bread earner of her family of 11 members. Secretary Lion Durga Shankar Behera, Jt. Secretary Lion Rishikesh Musmade and other Lion members of the club were present for this activity', 6, 'false', 11, 'DISTRICT ACTIVITIES', 'Roti Bank  - Anna Chhatra', 'Roti Bank  - Anna Chhatra', 'Swapnapoorti Phase - 1 Hsg. Society', 4893941, 46113, 0, ''),
(3152, 1765, 'Blood donation camp', 'PUNE', '2021-01-26', '', 'Hello everyone \r\nOur Lions  club  of  pune  Bibvewadi  had organized  blood donation  camp  on 26.1.2021\r\nBecause of the members efforts and interest towards donating the blood in such pandemic also we achieved target of 64 blood bags on 26th January \r\nThis has appreciated by the blood bank, dg, and from all the guests \r\nLooking for the same and more support in future \r\nThankyou everyone \r\nðŸ™ðŸ™', 60, 'false', 64, 'MEDICAL ACTIVITIES', 'Blood Donation', 'Blood Donation', 'Pune dadwadi', 4659480, 61275, 0, ''),
(3153, 1765, 'D G VISIT ', 'PUNE', '2021-01-26', '', ' Our DG LION Abay shastri visited Our Lions  club  of  pune  Bibvewadi  on 26.1.2021. During blood donation  camp our DG Visited our club ', 6, 'false', 64, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Pune dada wadi, saras baug road', 4659480, 61275, 0, ''),
