(3155, 12500, 'Distribution of Woolen Blankets for Street Beggers , Station Coolies,etc', 'Pune', '2021-01-09', 'DG. Ln. Abhay Shastri, Ln. Anuradha Shastri, Ln. Sunita Chitnis, Ln. Suraj Jagdale', 'We distributed 50 Woolen blankets to the poor peoples who live on road side and also the needy railway coolies at Pune railway station.', 20, 'false', 50, 'DISTRICT ACTIVITIES', 'Others', 'Others', 'Pune Railway Station', 4518401, 38744, 0, ''),
