(53, 'Leo Club of Poona Ganeshkhind Installation & Induction', 0, 'VDG1 Lion Hemant Naik', '2020-09-29', 'Zoom', 'We will install the PST Team and induct our new members virtually on 30th September, 2020. The installing officer is VDG1 Lion Hemant Naik and the inducting officer is Past ZC Lion Kuresh Polen. It will be attended by RC Lion Shriprakash Bagadi and ZC Lion Rajkumar Anand.', 'free', 2604283, 44129),
