INSERT INTO `general-content` (`type`, `description`, `last-update`) VALUES
('privacy-policy', '<p><strong>WHAT DO WE DO WITH YOUR INFORMATION?</strong></p>\r\n\r\n<p>When you user on our platform, as a part of the Lions District 3234 D2 developed by HSPM Solutions LLP., Knowing Enterprise , we collect the personal information you give us such as your name, address, mobile number and email address.</p>\r\n\r\n<p>We also access your mobile camera for clicking images while reporting.</p>\r\n\r\n<p><br />\r\nWhen you browse our platform, we also automatically receive your devices&nbsp;internet protocol (IP) address in order to provide us with information that helps us learn about your browser and operating system.<br />\r\nEmail marketing: With your permission, we may send you emails about our platform, new products/services and other relevant updates.</p>\r\n\r\n<p><strong>HOW DO YOU GET MY CONSENT?</strong></p>\r\n\r\n<p>When you provide us with your personal information to complete a while completing any transaction, verify your credit cardor subscribing, we imply that you consent to our collecting it and using it for that specific reason only.<br />\r\nIf we ask for your personal information for a secondary reason, like marketing, we will either ask you directly for your expressed consent, or provide you with an opportunity to say no.</p>\r\n\r\n<p><strong>HOW DO I WITHDRAW MY CONSENT?</strong></p>\r\n\r\n<p>In case you want to withdraw your consent from us either to contact you or using/disclosing your information, you may opt-out anytime by writing us at&nbsp;support@hspmsolutions.com&nbsp;or contacting us at:&nbsp;<br />\r\nIndira Shankar Nagari, Bhusari Colony,<br />\r\nKothrud, Pune, Maharashtra 411038</p>\r\n\r\n<p>If after you opt-in, you change your mind, you may withdraw your consent for us to contact you, for the continued collection, use or disclosure of your information, at any-time, by contacting us at&nbsp;support@hspmsolutions.com&nbsp; or mailing us at:&nbsp;HSPM Solutions Indira Shankar Nagari, Bhusari Colony,<br />\r\nKothrud, Pune, Maharashtra 411038</p>\r\n\r\n<p><strong>DISCLOSURE</strong></p>\r\n\r\n<p>We may disclose your personal information if we are required by law to do so or if you violate our Terms of Service.</p>\r\n\r\n<p><strong>LEGAL DISCLAIMER</strong></p>\r\n\r\n<p>We reserve the right to disclose your personally identifiable information as required by law and when we believe that disclosure is necessary to protect our rights and/or comply with a judicial proceeding, court order, or legal process served on the Website.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TESTIMONIALS</strong></p>\r\n\r\n<p>We post customer testimonials on the Website which may contain personally identifiable information such as customer name. If you want to remove your personal information that is being displayed on the Website under public pages please send your request to contacting us at&nbsp;support@hspmsolutions.com&nbsp; or mailing us at:&nbsp;HSPM Solutions Indira Shankar Nagari, Bhusari Colony, Kothrud, Pune, Maharashtra 411038</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CHILDREN&nbsp;PRIVACY</strong></p>\r\n\r\n<p>Software Advice does not solicit personal information from children. We abide by the INDIAN Children&nbsp;Online Privacy Protection Act and will not knowingly collect personally identifiable information from children under age 13. We recommend that parents actively participate in their children&#39;s use of the Internet.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>THIRD-PARTY SERVICES</strong></p>\r\n\r\n<p>In general, the third-party providers used by us will only collect, use and disclose your information to the extent necessary so as to allow them to perform the services they provide to us.<br />\r\nHowever, certain third-party service providers, such as payment gateways and other payment transaction processors, have their own privacy policies in respect to the information we are required to provide to them for your purchase-related transactions.<br />\r\n&nbsp;</p>\r\n\r\n<p>For these providers, we recommend that you read their privacy policies so you can understand the manner in which your personal information will be handled by these providers.<br />\r\nIn particular, remember that certain providers may be located in or have facilities that are located in a different jurisdiction than either you or us. So if you elect to proceed with a transaction that involves the services of a third-party service provider, then your information may become subject to the laws of the jurisdiction(s) in which that service provider or its facilities are located.<br />\r\nOnce you leave our platform or are redirected to a third-party website or application, you are no longer governed by this Privacy Policy or our websites Terms of Service.&nbsp;<br />\r\nWhen you click on links on our web application, they may direct you away from our site. We are not responsible for the privacy practices of other sites and encourage you to also read their privacy statements.</p>\r\n\r\n<p><strong>SECURITY</strong></p>\r\n\r\n<p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.</p>\r\n\r\n<p><strong>COOKIES</strong></p>\r\n\r\n<p>We use cookies to maintain session of your user usage. It is not used to personally identify you on other websites.</p>\r\n\r\n<p><strong>AGE OF CONSENT</strong></p>\r\n\r\n<p>By using this site, you represent that you are at least the age of majority in your state or province of residence, or that you are the age of majority in your state or province of residence and you have given us your consent to allow any of your minor dependents to use this site.</p>\r\n\r\n<p><strong>CHANGES TO THIS PRIVACY POLICY</strong></p>\r\n\r\n<p>We reserve the right to modify this privacy policy at any time, so please review it frequently. Changes and clarifications will take be in effect immediately upon their posting on the website. If we make material changes to this policy, we will notify you here that it has been updated, so that you are aware of what information we collect, how we use it, and under what circumstances, if any, we use and/or disclose it.<br />\r\nIf our product is acquired or merged with another company, your information may be transferred to the new owners so that we may continue to sell product to you.</p>\r\n\r\n<p><strong>QUESTIONS AND CONTACT INFORMATION</strong></p>\r\n\r\n<p>If you would like to access, correct, amend or delete any personal information we have about you, register a complaint, or simply if you want more information please contact our Privacy Compliance Officer at&nbsp; support@hspmsolutions.com&nbsp; or mailing us at:&nbsp;HSPM Solutions Indira Shankar Nagari, Bhusari Colony,<br />\r\nKothrud, Pune, Maharashtra 411038</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>APPLICABLE LAW</strong></p>\r\n\r\n<p>Our collection and use of information shall be governed by laws of the Pune Judicial.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2020-07-19 00:32:52'),
('terms-and-conditions', '<p>Please read these Terms of Service completely using lions3234d2.com which is operated by HSPM&nbsp;Solutions LLP. This Agreement documents the legally binding terms and conditions attached to the use of the Site at lions3234d2.com&nbsp;</p>\r\n\r\n<p>Privacy At certain points in the website navigation, you may be asked to share your email address or other personal identifying information with us. As provided in these Terms and Conditions, such information will never be distributed to a third party and it will never be publicly visible without your express written consent. Your email address will only be used to send you the important mails and/or to alert you to any information that you have specifically requested you be notified about. While we invite you to share your opinions and questions, they must not be used to distribute spam messages, or spread links to malicious or dangerous websites.</p>\r\n\r\n<p>We do retain the right to moderate any comment or written content submitted to the lions3234d2.com&nbsp;website and to remove any content we deem to have violated our policies. Disclaimer All of the content contained on the lions3234d2.com&nbsp;is edited, checked, and verified for accuracy as much as it is possible to do so. However, we cannot guarantee either its accuracy or the safety of any external links it might contain.</p>\r\n\r\n<p>lions3234d2.com, as well as Lions District 3234 D2&nbsp;can therefore not be held responsible for any problems or damage that occurs as a result of making use of material contained on our site. Copyright Any and all of the content presented on the lions3234d2.com&nbsp;website is subject to a copyright held by HSPM&nbsp;Solutions LLP.&nbsp; It is permissible to link to content from this site as long as the original source is clearly stated, but the wholesale reproduction or partial modification of content is not permitted.</p>\r\n\r\n<p>Exceptions are granted only if you receive prior written consent from lions3234d2.com.&nbsp;</p>', '2020-07-19 00:32:52'),
