('terms-and-conditions', '<p>Please read these Terms of Service completely using lions3234d2.com which is operated by HSPM&nbsp;Solutions LLP. This Agreement documents the legally binding terms and conditions attached to the use of the Site at lions3234d2.com&nbsp;</p>\r\n\r\n<p>Privacy At certain points in the website navigation, you may be asked to share your email address or other personal identifying information with us. As provided in these Terms and Conditions, such information will never be distributed to a third party and it will never be publicly visible without your express written consent. Your email address will only be used to send you the important mails and/or to alert you to any information that you have specifically requested you be notified about. While we invite you to share your opinions and questions, they must not be used to distribute spam messages, or spread links to malicious or dangerous websites.</p>\r\n\r\n<p>We do retain the right to moderate any comment or written content submitted to the lions3234d2.com&nbsp;website and to remove any content we deem to have violated our policies. Disclaimer All of the content contained on the lions3234d2.com&nbsp;is edited, checked, and verified for accuracy as much as it is possible to do so. However, we cannot guarantee either its accuracy or the safety of any external links it might contain.</p>\r\n\r\n<p>lions3234d2.com, as well as Lions District 3234 D2&nbsp;can therefore not be held responsible for any problems or damage that occurs as a result of making use of material contained on our site. Copyright Any and all of the content presented on the lions3234d2.com&nbsp;website is subject to a copyright held by HSPM&nbsp;Solutions LLP.&nbsp; It is permissible to link to content from this site as long as the original source is clearly stated, but the wholesale reproduction or partial modification of content is not permitted.</p>\r\n\r\n<p>Exceptions are granted only if you receive prior written consent from lions3234d2.com.&nbsp;</p>', '2020-07-19 00:32:52');
