(105, 'lions club of Nasik star -Helping hand to rural people', '2020-07-30 07:00:00', '\r\nAnd as new lionistic year has started lcons, under the leadership of new president Ln. Dr. Nupura  Prabhu, played an important role in the fight against the covid 19 pandemic, that is grappling the entire world.\r\nIn response to the call of action given by the district governor, Ln. Abhay Shastri, to eradicate the corona virus,   Arsenic Album 30 HOMEOPATHIC MEDICINES, were procured from Motiwala homeopathic medical college and distributed in the rural villages surrounding Trimbakeshwar.\r\nThe medicines tend to boost the immunity of the recipients and are there by known to cause a decrease in the nos. of cases caused by of the corona virus. The tablets are to be taken for three days of a month, followed by repeat of the doses in the next month. Sufficient quantity was provided, so as to benefit 1000 people residing in the rural areas.\r\nSwami Shreekanthanand  head of RAMKRISHNA  AROGYA SANSTHAAN,also played a very important role in the project , particularly in the distribution  of the medicines in the rural areas.\r\nThe activity was conducted, maintaining all protocols of social distancing as demanded by the present situation. Along with this 300 sanitizer bottles and disinfecting phenol solution were also provided  to the villagers  to protect themselves.\r\nPresident Ln.Dr. Nupura Prabhu, IPP ln.Nilima Dawre, and Ln. Dr. Amit Prabhu ,Ln.Sarika Kalantri(Secretary ) and ln. Abhay Patil(treasurer)participated in the successful execution of the service activity .                                                                 \r\n\r\n', '#', 4520195, 97806, 1),
(106, 'lions club of Nasik star -Arsenic album 30 , sanitizer distribution and Book donation', '2020-07-30 07:00:00', 'Activity: # FightAgainstCoronaVirus \r\n\r\n*Date: 27/7/20\r\n*750 bottles of Arsenic album 30 were given to be distributed \r\n* at brahmanwade,sinnar \r\n*To boost immunity against the Corona virus spread\r\n*Beneficiaries: 750 families\r\n*Dosage of 2 months.\r\n\r\n# Donation of text books \r\n* Over 70 books for the 8th,9th and 10th STD,Marathi medium\r\n* Donation to brahmanwade school ,trimbakeshwar\r\n*Date: 27/7/20\r\n\r\n\r\n\r\n', '#', 4520195, 97806, 1),
(107, 'lions club of nasik star -felicitation of corona worriers', '2020-07-09 07:00:00', 'Activity: felicitation of Corona warriors \r\nDate: 1/7/20\r\nTime: 12:pm\r\n\r\nLions club of nasik star set the wheels of service in motion right from day 1 . \r\n Cleaners and sweepers of Vaishnavi enterprises were felicitated with face masks, face shields, rubber gloves and sanitisers for their own safety and protection. \r\nClub members expressed their gratitude by distributing certificates to the sweepers for their dedication towards keeping the premises and environment clean.\r\n Zone chairperson ln. Ritu Chaudhary also addressed the audience in the presence of the incoming PST team and the members present.\r\n\r\nLooking forward to genuine and impactful activities in the lionistic year 20-21.\r\n\r\n Going miles in spreading smiles!!! \r\nKeeping service before self at LC of NASIK STAR.\r\n', '#', 4520195, 97806, 1),
(110, 'SAKAL RELIEF FUND', '2020-07-08 07:00:00', 'LIONS CLUB OF PUNE SENIORS HAS DONATION OF RS 51000=OO TO SAKAL RELIEF FUND. ON IT\'S APPEAL IN SAKAL NEWS PAPER TO HELP POOR BOYS  WHO SELL DAILY NEWS PAPERS  ON THE STREET. 1D MJF PDG LN SHARADCHANDRA PATANKAR HAS HANDED  OVER THE CHEQUE TO CONCERNED  OFFICER SHRI PISAL', '#', 5190752, 84998, 0),
