(122, 'NASIK STAR  donates computer and 470 books to NAGALWadi RURAL SCHOOL', '2020-08-11 07:00:00', 'Lions club of Nasik Star, under their initiative to support education donated \r\n# Computer and \r\n# over 400 books (Chetna publications) \r\n# ZP school, Nagalwadi 	\r\n# For STD 1-5 \r\nA fully educational and well equipped computer was donated to the school as requested by the teachers.\r\nThe activity was conducted at the \' ZONE ADVISARY\' organised by ZC ln Ritu choudhary . \r\nPresident Ln Dr Nupura Prabhu along with IPP Ln Nilima daware informed all the dignitaries about the purpose of the activity. \r\nThe books were handed over to the teacher of the school,Mrs Sharmila bachhav,at the hands of PDG Ln Dr. Vikrant Jadhav and RC ln Rajendra Pagar. Other members  in conducting the activity were secretary Ln Sarika kalantri, Treasurer Ln Abhay patil, Ln Nitin Marathe, Ln Ram dawre, Aditya dawre , Ln Santosh Kalantri and Ln Nilima Jadhav.\r\n\r\nFuture endeavours in this school include setting a computer lab and building hygienic toilet blocks for good sanitation.', '#', 2870091, 97806, 1),
(124, 'NASIK STAR organizes webinar on CYBERSECURITY..', '2020-08-13 07:00:00', 'lions club of NASIK STAR organises webinar on CYBERSECURITY\r\na webinar was conducted on cybersecurity.attended by dignitaries from lions as well as other fields,more than 100 families participated in the webinar. covered various aspects of cybercrime like phishing scamming fake websites and hacking etc. practical aspects to handle cybercrime were discussed.', '#', 2870091, 97806, 1),
