(129, 'Ln.Dr.Nupura Prabhu takes charge as president : Lions Club of NASIK STAR', '2020-08-19 07:00:00', 'LIONS CLUB of NASIK STAR....... INSTALLATION CEREMONY.\r\n\r\nLions club of Nasik star , on 2nd aug 2020, organised the \r\n#INSTALLATION CEREMONY,\r\n#of incoming president Ln. Dr.NUPURA PRABHU, and her team\r\n#at hotel blvd in a unique professional and safe manner.\r\n\r\nIn its fifteenth year of operation outgoing president Ln.Mrs Nilima Dawre called the meeting to order.After the flag salutation given by Ln.Mrs.Ashwini Bag, PRO of the club,MRS.Nilima Daware presented her report about all the service activities done by the club under her leadership. She thanked all the members for their support and involvement before giving her best wishes to the incoming team.\r\n\r\nThe chief INSTALLATION OFFICER of the programme , Vice District Governor Ln.Rajesh Kothawade, was introduced to the audience by Ln.Mahesh Bharbat , in a unique way. Ln. Rajesh kothawade appreciated the work done by Team NASIK STAR, then installed the board of directors and team of incoming president Ln.Dr.Nupura Prabhu in a unique theme based manner, based on the festival of DAHI HANDI. Drawing parellels between the  way the govindas reach the handi by forming a human pyramid, he emphasised the values of TEAM WORK, COORDINATION, RISK TAKING,CONCENTRATION, FOCUSSING ON THE GOAL ,TRUST AND MAN MANAGEMENT that are all demonstrated by the dahi handi festival.Having delivered the oath to perform to the best of their ability, incoming President Ln.Dr.Nupura Prabhu accepted the charge from outgoing President Ln.Nilima Daware.\r\n\r\nThis was followed by the Acceptance speech of  President Ln Dr.Nupura Prabhu, in which she gave a glimpse of her plans in the year to come. Emphasing on principle of one for all and all for one, she appealed to the club members to come together in making our community a better place ,inspite of the challenges faced by us on account of the covid 19 pandemic.\r\n\r\nThe Chief Guest and Keynote Speaker of the programme Mr.PRAFULLA CHIKERUR, ex registrar YCMOU, corporate trainer  management and  motivational speaker,was then called upon by Ln.Urja patil ,to deliver his address on  10  COMMANDMENTS of a SUCCESSFUL SOCIAL WORKER. He enthralled the audience in his subtle style of delivery while emphasising on the qualities of an ideal social worker like Honesty, compassion,impactfulness,scale  focus etc.\r\n\r\nThis was followed by an activity in which Three ply Masks and sanitisers were donated  to mr.nagvanshi, at the hands of Ln.Rajesh Kothawade.\r\n\r\nCharter member of the club LN.Mr.Nitin Marathe and  LN.Mrs. Meera N Marathe handed over a cheque of rs.50000 to president Ln.Dr.Nupura Prabhu as donation towards activities of the club.\r\nAfter felicitation of the dignitaries  with mementos,incoming secretary Ln.Sarika Kalantri delivered the vote of thanks.\r\nThe meeting was then adjourned by the president.\r\n\r\nThe proceedings of the programme were managed by MOC Ln.Santosh Kalantri. this was done via a unique theme based on vedic  mathematics ,comparing it to the leadership qualities  of the involved leaders.\r\n\r\nRegion Chairperson Ln.Rajendra Pagar graced the occasion. All members of the club including Ln.CA Ram Daware,Ln.Prashant Bharbat,Ln.Nisha Bharbat,Treasurer Ln.Abhay Patil,Ln.CA.Lalit Pawar,Ln.Abhay Bag, ln Gopal birar,Ln shilpa Marathe', '#', 2870091, 97806, 1),
