uest and Keynote Speaker of the programme Mr.PRAFULLA CHIKERUR, ex registrar YCMOU, corporate trainer  management and  motivational speaker,was then called upon by Ln.Urja patil ,to deliver his address on  10  COMMANDMENTS of a SUCCESSFUL SOCIAL WORKER. He enthralled the audience in his subtle style of delivery while emphasising on the qualities of an ideal social worker like Honesty, compassion,impactfulness,scale  focus etc.\r\n\r\nThis was followed by an activity in which Three ply Masks and sanitisers were donated  to mr.nagvanshi, at the hands of Ln.Rajesh Kothawade.\r\n\r\nCharter member of the club LN.Mr.Nitin Marathe and  LN.Mrs. Meera N Marathe handed over a cheque of rs.50000 to president Ln.Dr.Nupura Prabhu as donation towards activities of the club.\r\nAfter felicitation of the dignitaries  with mementos,incoming secretary Ln.Sarika Kalantri delivered the vote of thanks.\r\nThe meeting was then adjourned by the president.\r\n\r\nThe proceedings of the programme were managed by MOC Ln.Santosh Kalantri. this was done via a unique theme based on vedic  mathematics ,comparing it to the leadership qualities  of the involved leaders.\r\n\r\nRegion Chairperson Ln.Rajendra Pagar graced the occasion. All members of the club including Ln.CA Ram Daware,Ln.Prashant Bharbat,Ln.Nisha Bharbat,Treasurer Ln.Abhay Patil,Ln.CA.Lalit Pawar,Ln.Abhay Bag, ln Gopal birar,Ln shilpa Marathe', '#', 2870091, 97806, 1),
