(157, 'LCO Nasik star conducts LOAN-A-PHONE campaign successfully to Bramhanwade', '2020-09-08 07:00:00', 'LCO Nasik star successfully conducts the LOAN-A-PHONE campaign:\r\n# date: 5th sept 2020 \r\n# place: Brahmanwade school, trimbakeshwar \r\n\r\nUnder the leadership of newly elected President Ln.Dr.NUPURA PRABHU,all star lions went into action to achieve the arduos task of collecting smartphones  for conducting online classes for the 40 odd students of the 10th standard this academic year...\r\nWorking unitedly for over a month, star members reached out to all sections of society to successfully collected 20 smart phones. \r\n\r\n The JIO team:( Mr Juzer Dorajiwala from STAR Mobiles) was present there too for biometrics to activate 20  sim cards with data connection such that these students can access zoom classes thru the internet.\r\nLn.DrAmit Prabhu and Ln Dr Nupura prabhu,conversed with the students about the importance of education and encouraged the students to pursue their studies as further as possible.they also warned the students about the perils of  the internet and its misuse. \r\nall the involved students were trained in the above mentioned apps by the club members.\r\neach member pledged to take responsibility of 1 child to track their progress as they use these smartphones.', '#', 4520195, 97806, 1),
