(161, 'NASIK STAR : LASER PRINTER DONATION & #FIGHT AGAINST CORONA, ARSENIC 30 TABLETS DISTRIBUTED TO bramhanwade village', '2020-09-09 07:00:00', 'LCO Nasik star donates a laser printer to Brahmanwade school\r\n#date: 5th sept\r\n#place: Brahmanwade school, trimbakeshwa\r\n\r\nResponding to the request made by the school teachers LC Nasik Star also presented the school with a laser printer to aid the teachers in their administrative work.\r\nThis was sponsored by Lion Prashant and Nisha Bharbat.\r\n\r\nLCO NASIK star distributes arsenic album 30 to families of  brahmanwade \r\n#fightCoronavirus\r\n# date: 5th sept 2020\r\n# place: brahmanwade trimbakeshwar\r\n\r\nArsenic album 30,the immunity boosting medicine was distributed to 700 families reaching over 2800 people  of the village.\r\nLn Nilima Daware played a major role in procuring them,explaining the importance and method of consuming them. Along with ln ram daware the medicine s were distributed.\r\n\r\n', '#', 2870091, 97806, 1),
