(208, ' Donation of personal hygiene products', '2020-10-17 07:00:00', 'Good personal hygiene is important for both health and social reasons. It entails keeping your hands, head and body clean so as to stop the spread of germs and illness. An Girls orphanage where in 27 girls stays were provided personal hygiene products for Dental care for Hair care for body & hand care For washing cloths, For floor & toilets', '#', 4403075, 61500, 0),
