(246, 'Nirogi shareer Nirogi Mann', '2020-12-09 07:00:00', 'One Day International webinar on : \r\n*Nirogi Sharir Nirogi Mann*\r\nKnow your right posture, right eating habits, acceptance to lead a happy peaceful life by \r\nDr. Bhumika Chakravorty\r\nPhysiotherapist (BPTh)\r\nDr. Shivani Tupe\r\nHomeopath (BHMS)\r\nWorking as Assistant Doctors with Dr. Rajiv Sharangpani since  5 years.\r\n*100 participants joined the webinar. *\r\n*Organising Clubs: *\r\n1.LCP Sinhgad Road and \r\n2.LC  Poona West in association with \r\n3.LC Pune Seniors\r\n4. Lions Club Samarpit (Kathmandu)\r\n5. Lioness Club Washim\r\n6. LCP Sunrise\r\n7. Lions club of Ahmedabad Karnavati D zire Lns\r\n8. LCP Vijaynagar\r\n9. LCP Status\r\n10. LCP Art Lovers\r\n_â€œ Coming together is beginning, keeping together is progress and working together is Successâ€. _', 'https://youtu.be/LlcRMw43VdA', 4625291, 57692, 0),
(247, 'LOKMAT', '2020-12-01 07:00:00', 'DISTRIBUTION OF SANITARY NAPKINS, DIWALI SWEETS AND NEW CLOTHS TO NARI VIKAS SWADHAR KENDRA', '#', 4957327, 31685, 0),
(248, 'News paper clipping of World Diabetes Day Program in Indian Express', '2020-12-13 07:00:00', 'Our club along with few more clubs had organised the World Diabetes Day program at Suryadatta Institutes, Bavdhan, Pune on 5th December 2020 with Diabetes Checkup camp and lecture of Dr Ashwini Joshi, Diabetologist, which was also telecasted live on Facebook simultaneously.', 'https://www.facebook.com/873663659319087/posts/3880714425280647/?sfnsn=wiwspmo', 2687816, 63541, 1),
(249, 'Newspaper Cutting of Diabetes Day Program at Suryadatta Institute published in Punyanagari', '2020-12-12 07:00:00', 'Our club had organised a World Diabetes Day program along with a few more clubs at Suryadatta Institutes, Bavdhan, Pune on 5th Dec. 2020 and also A Diabetes Checkup camp at same place same day. It was telecasted live on Facebook.', 'https://www.facebook.com/873663659319087/posts/3880714425280647/?sfnsn=wiwspmo', 2687816, 63541, 1),
(250, 'Art and Craft', '2020-12-12 07:00:00', 'DIY workshop on wall clock and Mug printing was organised by LCP Sinhgad Road. 87 participants were a part of this workshop. ', 'https://youtu.be/EiOWiGOALU4', 4625291, 57692, 0),
(251, 'Diwali Festival Celibration With Tribal Families', '2020-11-13 07:00:00', 'We Distributed Saris, Sweet Boxes To 65 Tribal Families. \r\nWe honored father mother and widow wife of Late army soldier Malhari Khadu Lahire giving cloths, woolen coat and sweet boxes.', '#', 5342216, 45834, 0),
(252, 'Blood Donation Camp by Lions Club', '2020-12-18 07:00:00', 'Lions Club Of Poona West has organized blood donation camp on 13 th dec 2020 at Pratidyna Mangal Karyalaya,Pune. 77 people donated blood. DG MJF Ln Abhayji Shatri Sir, Ln Madhuri Shastri, President Ln Pallavi Deshmukh, Ln Seema Dabke & all other members were present at that time.', '#', 4653193, 53804, 0),
(253, 'LCO Nasik Inducted new members with the donation of 30 workbook to Bramhanwade school.', '2020-12-20 07:00:00', 'It is right said that If there is any lions function there will be activity. Likewise, though there was Induction+Orientation+ R.C Visit there was activity too. Yes, LCO Nasik star distributed 30 workbooks to 10th std. students of Bramhanwade school. Principle Gite sir attended the event and LCO Nasik star handed over it to him. Which may surely develop their writing skills, even it will help them in giving final exam papers. Ln. Abhay Bag sponsored these books as he himself took efforts to develop these books.', '#', 4520195, 97806, 0),
(254, 'Blood Donation Camp on 25th Dec. 2020 at Kohinoor M. Karyalay, Pune 4', '2020-12-29 07:00:00', 'Blood Donation Camp organised by LCP 21st Century on 25th Dec. 2020 at Kohinoor M. Karyalay, Pune 4. It was inaugurated by MLA Shri. Shirole along with PMC Corporators.  DG, RC, ZC and PDG Lion Dr. Chandrahas Shetty visited it.', '#', 2687816, 63541, 1),
(255, 'Donation to dialysis center', '2020-12-24 07:00:00', 'We have donated 8 patients dialysis charges for treatment to Dignopain dialysis center in wadgaon sheri pune ', '#', 4674482, 132038, 0),
